B.Kz=A.a(s(["For k=0, i.e. without negative feedback, the characteristic curve is very steep (high amplification), but also highly non-linear, which indicates high distortion.","As k increases, the slope of the characteristic curve and thus the gain decreases. At the same time, however, the nonlinearity of the characteristic curve also decreases. Thus, negative feedback causes a decrease in gain, but also a decrease in distortion.","From the equation for A it follows that for sufficiently large values of a*k, the so-called loop gain, the total gain goes over into A=1/k. Thus, negative feedback causes the total gain A to no longer depend on the amplifier properties a, but only on the feedback network k.","If the loop gain a*k takes the value -1, the expression for A approaches infinity. In this case, the feedback amplifier oscillates. Since this is usually not desirable (exception: oscillator), the question arises as to how criteria for the stability of a feedback amplifier circuit can be specified."]),t.s)
B.yn=new A.cs(B.Kz,null)
B.HQ=A.a(s(["At the collector end (X=XB), the density n\xb4 is very low (~0) due to UBC<0, while at the emitter end (X=0) it reaches very high values due to UBE >0V. Due to the exponential dependence, even small voltage changes UBE are sufficient to achieve a change in the density of n` at the emitter end (X=0) of the base. The slope \u2013 and thus the current Ic through the transistor \u2013 thus depends directly on the base-emitter voltage UBE, whereby even very small changes in the base-emitter voltage cause a large change in Ic (amplifier effect)."]),t.s)
B.yo=new A.cs(B.HQ,null)
B.JR=A.a(s(["F\xfcr k=0, d.h. ohne Gegenkopplung, ist die Kennlinie sehr steil (hohe Verst\xe4rkung), aber auch stark nichtlinear, was auf gro\xdfe Verzerrungen hindeutet.","F\xfcr gr\xf6\xdfer werdendes k nimmt die Steigung der Kennlinie und damit auch die Verst\xe4rkung ab. Gleichzeitig verringert sich aber auch die Nichtlinearit\xe4t der Kennlinie. Gegenkopplung bewirkt also eine Abnahme der Verst\xe4rkung, aber auch einen R\xfcckgang der Verzerrungen.","Aus der Gleichung f\xfcr A folgt, dass f\xfcr hinreichend gro\xdfe Werte von a*k, der so genannten Schleifenverst\xe4rkung, die Gesamtverst\xe4rkung in A=1/k \xfcbergeht. Gegenkopplung bewirkt somit, dass die Gesamtverst\xe4rkung A nicht mehr von den Verst\xe4rkereigenschaften a, sondern nur noch von dem Gegenkopplungsnetzwerk k abh\xe4ngig ist.","Nimmt die Schleifenverst\xe4rkung a*k den Wert -1 an, so geht der Ausdruck f\xfcr A gegen unendlich. In diesem Fall schwingt der r\xfcckgekoppelte Verst\xe4rker. Da dies in der Regel nicht erw\xfcnscht ist (Ausnahme: Oszillator), stellt sich die Frage, wie sich Kriterien f\xfcr die Stabilit\xe4t einer gegengekoppelten Verst\xe4rkerschaltung angeben lassen."]),t.s)
