B.Hh=A.a(s(["F\xfcr sehr gro\xdfe Basisweiten XB entspricht die Ladungstr\xe4gerverteilung der Basis-Emitter-Diode einem in Durchlassrichtung gepolten pn-\xdcbergang. Der Wert von n' an der Stelle x=0 wird dabei von der Spannung UBE \xfcber der Basis-Emitter-Diode bestimmt. Mit zunehmendem Abstand von der Raumladungszone nehmen die Minorit\xe4tstr\xe4gerdichten f\xfcr gro\xdfe Basisweiten dann exponentiell ab.","Der Basis-Kollektor-\xdcbergang des Transistors ist im Normalbetrieb in Sperrrichtung gepolt, so dass die \xdcberschussladungstr\xe4gerdichten n' und p' an den R\xe4ndern der Basis-Kollektor-Raumladungszone praktisch null sind.","Bringt man die beiden pn-\xdcberg\xe4nge sehr dicht zusammen, d.h. ist die Basisweite XB sehr klein, wird aus dem exponentiellen Verlauf der Ladungstr\xe4ger n' in der Basis (blaue Kurve) n\xe4herungsweise eine Gerade. Diese hat eine um so gr\xf6\xdfere Steigung, je kleiner die Basisweite XB ist."]),t.s)
B.HW=A.a(s(["For very large base widths XB, the charge carrier distribution of the base-emitter diode corresponds to a pn junction polarized in the forward direction. The value of n' at the point x=0 is determined by the voltage UBE across the base-emitter diode. With increasing distance from the space charge region, the minority carrier densities for large base widths then decrease exponentially.","In normal operation, the base-collector junction of the transistor is reverse-biased, so that the excess carrier densities n' and p' at the edges of the base-collector space-charge region are practically zero.","If the two pn junctions are brought very close together, i.e. if the base width XB is very small, the exponential behavior of the charge carriers n' in the base (blue curve) becomes approximately linear. The smaller the base width XB, the steeper the slope of this line."]),t.s)
B.yD=new A.c_("Dieses Applet veranschaulicht die Ladungstr\xe4gerverteilung eines Bipolartransistors im Normalbetrieb f\xfcr unterschiedliche Basisweiten.\n\nMan sieht:\n",B.Hh,"This applet illustrates the charge carrier distribution of a bipolar transistor in normal operation for different base widths.\n\nYou can see:\n",B.HW,null)
B.J5=A.a(s(["Ist der Abstand zwischen den beiden Atomen hinreichend gro\xdf, so stehen diese nicht miteinander in Wechselwirkung. Die m\xf6glichen Energiewerte, die die beiden Atome annehmen k\xf6nnen, liegen auf der gleichen H\xf6he wie bei einem einzelnen Atom.","Bringt man die beiden Atome n\xe4her zusammen, so \xfcberlappen sich die Elektronenbahnen und beide Atome treten miteinander in Wechselwirkung. Dies bewirkt - \xe4hnlich wie bei gekoppelten Resonatoren - eine Aufspaltung der m\xf6glichen Energieniveaus, die um so st\xe4rker ist, je gr\xf6\xdfer die Kopplung, d.h. je geringer der Abstand zwischen den beiden Atomen ist."]),t.s)
B.KY=A.a(s(["If the distance between the two atoms is sufficiently large, they do not interact with each other. The possible energy values that the two atoms can assume are at the same level as for a single atom.","If the two atoms are brought closer together, the electron orbits overlap and the two atoms interact with each other.Similar to coupled resonators, this causes a splitting of the possible energy levels, which is all the stronger the greater the coupling, i.e. the smaller the distance between the two atoms."]),t.s)
B.yE=new A.c_("Das Applet zeigt die Auswirkungen auf die m\xf6glichen Energiezust\xe4nde W zweier einzelner Atome, wenn diese miteinander in Wechselwirkung gebracht werden, indem man den Abstand zwischen ihnen verringert.\n\nMan sieht:\n",B.J5,"The applet shows the effects on the possible energy states W of two individual atoms when they are brought into interaction with each other by reducing the distance between them.\n        \nYou can see:\n",B.KY,null)
B.HK=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Transistors T2 des Stromspiegels.","Im aktiven Vorw\xe4rtsbetrieb, d.h. f\xfcr UBC > 0V, verl\xe4uft die Kennlinie sehr flach, so dass der Strom Io n\xe4herungsweise konstant ist.","Nimmt die Spannung Uo am Ausgang des Stromspiegels zu, vermindert sich die Spannung UBC, bis der Basis-Kollektor-\xdcbergang des Transistors T2 schlie\xdflich f\xfcr UBC < 0V in Durchlassrichtung gepolt wird. Der Transistor T2 geht dann in S\xe4ttigung und der Strom Io nimmt ab.","Sind beide Transistoren gleich gro\xdf, d.h., ist IS1 = IS2, so entspricht der Strom Io im aktiven Vorw\xe4rtsbetrieb etwa dem Strom Iref durch den Referenztransistor T1.","Das Stromverh\xe4ltnis Io zu Iref kann \xfcber das Verh\xe4ltnis IS1 zu IS2 eingestellt werden, so dass sich mit dem Stromspiegel beliebige Str\xf6me generieren lassen.","Die Steigung der Kennlinie des Transistors T2 h\xe4ngt von dem Ausgangswiderstand r0 des Transistors und damit von der Early-Spannung Uan ab. Je gr\xf6\xdfer die Early-Spannung Uan ist, um so flacher verl\xe4uft die Kennlinie, d.h. um so weniger h\xe4ngt der eingestellte Strom Io von der Spannung Uo ab."]),t.s)
B.Iw=A.a(s(["The blue curve corresponds to the characteristic curve of transistor T2 of the current mirror.","In active forward mode, i.e. for UBC > 0V, the characteristic curve is very flat, so that the current Io is approximately constant.","If the voltage Uo at the output of the current mirror increases, the voltage UBC decreases until the base-collector junction of transistor T2 is finally polarized in the forward direction for UBC < 0V. Transistor T2 then goes into saturation and the current Io decreases.","If both transistors are the same size, i.e. IS1 = IS2, the current Io in active forward operation corresponds approximately to the current Iref through the reference transistor T1.","The current ratio Io to Iref can be adjusted via the ratio IS1 to IS2, so that any current can be generated with the current mirror.","The slope of the characteristic curve of transistor T2 depends on the output resistance r0 of the transistor and thus on the early voltage Uan. The greater the early voltage Uan, the flatter the characteristic curve, i.e. the less the set current Io depends on the voltage Uo."]),t.s)
B.yG=new A.c_("Dieses Applet veranschaulicht die Funktion eines Stromspiegels mit pnp-Transistoren.\n\nMan sieht:\n",B.HK,"This applet illustrates the function of a current mirror with pnp transistors.\n\nYou can see:\n",B.Iw,null)
B.JH=A.a(s(["Da allein die Null- und Polstellen der \xdcbertragungsfunktion die \xdcbertragungseigenschaften der Schaltung festlegen, gen\xfcgt es, deren Lage in der komplexen Ebene anzugeben, was durch Kreuze (x) f\xfcr Pole und Kreise (o) f\xfcr Nullstellen erfolgt. Die in diesem Beispiel gezeigte Schaltung weist also zwei Polstellen p1 und p2 und keine Nullstellen auf.","Durch \xc4nderung des Schaltungsparameters v \xe4ndert sich unmittelbar die \xdcbertragungsfunktion und damit auch die Lage der Polstellen in der komplexen Ebene wie im Bild oben links dargestellt.","Die Polstellenverteilung hat wiederum Einfluss auf den Frequenzgang |A(jw)| sowie den Phasengang phase(A(jw)) der Schaltung (Bild rechts oben bzw. unten).","Ebenso besteht ein wichtiger Zusammenhang zwischen der Lage der Polstellen und dem dynamischen Verhalten der Schaltung. Da jeder Pol s' der \xdcbertragungsfunktion A(s) einen Term der Form 1-exp(s' t) in der Sprungantwort liefert (Laplace-Transformation), bedeutet ein reeller Pol in der linken Halbebene der komplexen Frequenzebene (v<1) einen aperiodischen Anstieg der Sprungantwort auf deren Endwert (hier: v). Ein konjugiert komplexes Polpaar in der linken Halbebene (1<v<3) verursacht wegen der komplexen Exponentialfunktion einen periodischen Einschwingvorgang und f\xfcr ein rein komplexes Polpaar (v=3) ergibt sich schlie\xdflich eine unged\xe4mpfte Sinusschwingung.","Je n\xe4her die Pole der \xdcbertragungsfunktion in Richtung der imagin\xe4ren Achse wandern, um so eher neigt die Schaltung zum Schwingen. Dies zeigt sich au\xdfer in der Sprungantwort auch in dem Frequenzgang |A(jw)|, der bei der Schwingfrequenz eine ausgepr\xe4gte \xdcberh\xf6hung zeigt. Besonders kritisch ist Situation bei gegengekoppelten Verst\xe4rkerschaltungen, bei denen man der Stabilit\xe4t besonderes Augenmerk widmen muss."]),t.s)
B.J2=A.a(s(["Since the zero and pole positions of the transfer function alone determine the transfer characteristics of the circuit, it is sufficient to indicate their position in the complex plane, which is done by crosses (x) for poles and circles (o) for zero positions. The circuit shown in this example therefore has two pole positions p1 and p2 and no zero positions.","By changing the circuit parameter v, the transfer function and thus the position of the poles in the complex plane change immediately, as shown in the figure above left.","The distribution of poles in turn influences the frequency response |A(jw)| and the phase response phase(A(jw)) of the circuit (top and bottom right).","There is also an important relationship between the location of the poles and the dynamic behavior of the circuit. Since each pole s' of the transfer function A(s) provides a term of the form 1-exp(s' t) in the step response (Laplace transformation), a real pole in the left half-plane of the complex frequency plane (v<1) means an aperiodic increase in the step response to its final value (here: v). A pair of conjugate complex poles in the left half-plane (1<v<3) causes a periodic transient due to the complex exponential function, and for a purely complex pair of poles (v=3) an undamped sinusoidal oscillation results.","The closer the poles of the transfer function move towards the imaginary axis, the more the circuit tends to oscillate. This is evident not only in the step response but also in the frequency response |A(jw)|, which shows a pronounced peak at the oscillation frequency. The situation is particularly critical in the case of negative feedback amplifier circuits, where particular attention must be paid to stability."]),t.s)
B.yH=new A.c_("Dieses Applet zeigt f\xfcr eine konkrete Schaltung mit der \xdcbertragungsfunktion A(jw)=ua/ue beispielhaft den Einfluss eines der Schaltungsparameter auf die Lage der Polstellen und damit auf den Frequenzgang. Ebenso ist der Einfluss der Lage der Pole auf den Phasengang und auf die Sprungantwort dargestellt.\n\nMan sieht:\n",B.JH,"This applet shows the influence of one of the circuit parameters on the location of the poles and thus on the frequency response for a specific circuit with the transfer function A(jw)=ua/ue. The influence of the location of the poles on the phase response and on the step response is also shown.\n\nYou can see:\n",B.J2,null)
B.HE=A.a(s(["Bei USB=0 flie\xdft ein Strom zwischen Source (S) und Drain (D), da durch die angelegte Gate-Spannung die Potenzialbarriere zwischen Source und Bulk \xfcberwunden werden kann und somit Elektronen zur Drain-Elektrode gelangen k\xf6nnen.","Legt man eine gegen\xfcber der Source-Elektrode negative Spannung an das Bulk, d.h. USB>0, so verschieben sich die Bandkanten Wc und Wv im Bereich des Bulks nach oben. Damit erh\xf6ht sich die von den Elektronen zu \xfcberwindende Barriere, was sich in einer h\xf6heren Einsatzspannung Uth ausdr\xfcckt. F\xfcr USB=3V ist diese Barriere so gro\xdf, dass sie nicht mehr von den Elektronen \xfcberwunden werden kann. Die Einsatzspannung ist in diesem Fall gr\xf6\xdfer als die Spannung UGS und der Transistor sperrt."]),t.s)
B.IA=A.a(s(["When USB=0, a current flows between source (S) and drain (D), because the applied gate voltage can overcome the potential barrier between source and bulk, allowing electrons to reach the drain electrode.","If a voltage that is negative with respect to the source electrode is applied to the bulk, i.e. USB>0, the band edges Wc and Wv in the bulk region shift upwards. This increases the barrier that the electrons have to overcome, which is expressed in a higher threshold voltage Uth. For USB=3V, this barrier is so large that it can no longer be overcome by the electrons. In this case, the threshold voltage is greater than the voltage UGS and the transistor blocks."]),t.s)
B.yJ=new A.c_("Das folgende Applet veranschaulicht den Substratsteuereffekt mit Hilfe des B\xe4nderdiagramms.\n\nMan sieht:\n",B.HE,"The following applet illustrates the substrate control effect using a band diagram.\n\nYou can see:\n",B.IA,null)
B.bW=A.a(s([]),t.s)
B.yK=new A.c_("Dieses Applet zeigt den prinzipiellen Ablauf eines NMOS-Prozesses am Beispiel der Herstellung eines n-Kanal Feldeffekttransistors. Der Anschaulichkeit halber sind nicht alle Prozessschritte im Einzelnen gezeigt und die Darstellungen sind zum Teil grob vereinfacht.\n",B.bW,"This applet shows the basic sequence of an NMOS process using the example of the production of an n-channel field-effect transistor. For the sake of clarity, not all process steps are shown in detail and the illustrations are somewhat simplified.",B.bW,null)
B.IS=A.a(s(["F\xfcr die gezeigte Schaltung kann die \xdcbertragungskennlinie grafisch konstruiert werden, indem das Ausgangskennlinienfeld IC=IC(UCE,UBE) des Transistors und die Kennlinie IC(UCE) des Widerstandes in ein Diagramm eingetragen werden. F\xfcr einen gegebenen Wert von UBE ergibt dann der Schnittpunkt der entsprechenden Transistorkennlinie mit der Widerstandsgeraden den dazugeh\xf6rigen Wert f\xfcr UCE.","Die Steigung dUCE/dUBE der \xdcbertragungskennline entspricht der Kleinsignalspannungsverst\xe4rkung Au. F\xfcr Werte UBE unter etwa 0,6V ist die Steigung und damit die Verst\xe4rkung etwa Null, da der Transistor sperrt. F\xfcr gro\xdfe Werte von UBE geht die Verst\xe4rkung ebenfalls gegen Null, da der Transistor in S\xe4ttigung geht."]),t.s)
B.Ke=A.a(s(["The transfer characteristic can be constructed graphically for the circuit shown by entering the output characteristic field IC=IC(UCE,UBE) of the transistor and the characteristic IC(UCE) of the resistor in a diagram. For a given value of UBE, the intersection of the corresponding transistor characteristic with the resistance straight line then gives the associated value for UCE.","The slope dUCE/dUBE of the transfer characteristic corresponds to the small-signal voltage gain Au. For values of UBE below about 0.6V, the slope and thus the gain is approximately zero, since the transistor is in the off state. For large values of UBE, the gain also approaches zero, since the transistor is in saturation."]),t.s)
B.yL=new A.c_("Dieses Applet zeigt die Konstruktion der \xdcbertragungskennlinie UCE=UCE(UBE) eines einfachen Verst\xe4rkers sowie den Einfluss wichtiger Schaltungsparameter (UB, R) auf die Verst\xe4rkung.\n\nMan sieht:\n",B.IS,"This applet shows the construction of the transfer characteristic UCE=UCE(UBE) of a simple amplifier and the influence of important circuit parameters (UB, R) on the amplification.\n\nYou can see:\n",B.Ke,null)
B.yN=new A.c_("Dieses Applet zeigt den stark vereinfachten Ablauf eines CMOS-Prozesses zur Herstellung integrierter Schaltungen. Im Gegensatz zum NMOS Prozess erlaubt der CMOS-Prozess die gleichzeitige Herstellung von n- und p-Kanal Feldeffekttransistoren auf einem Chip.\n",B.bW,"This applet shows the simplified process of a CMOS process for the production of integrated circuits. In contrast to the NMOS process, the CMOS process allows the simultaneous production of n- and p-channel field-effect transistors on a single chip.\n",B.bW,null)
B.J9=A.a(s(["Der Bipolartransistor besteht aus drei unterschiedlich dotierten Gebieten (Emitter, Basis und Kollektor). Im Fall des npn-Transistors sind der Emitter (E) und der Kollektor (C) n-dotiert, die Basis (B) ist p-dotiert, so dass man zwei hintereinandergeschaltete pn-\xdcberg\xe4nge erh\xe4lt."]),t.s)
B.K6=A.a(s(["The bipolar transistor consists of three differently doped regions (emitter, base and collector). In the case of the npn transistor, the emitter (E) and the collector (C) are n-doped, while the base (B) is p-doped, resulting in two pn junctions connected in series.","Englisch"]),t.s)
B.yO=new A.EV(null)
B.GY=A.a(s(["Bei niedrigen Temperaturen (hier: 300K) ist das Atom in einem energetisch niedrigen Zustand. In dem dargestellten Atommodell befindet sich das Elektron auf der inneren Schale.","Durch Erh\xf6hen der Temperatur gelangt das Elektron auf eine weiter au\xdfen liegende Schale. Dies entspricht einem angeregten Energiezustand.","Tr\xe4gt man die m\xf6glichen Energiewerte W, die das Atom annehmen kann, in einem einfachen Diagramm auf, so ergeben sich mehrere diskrete Zust\xe4nde (Energielinien), deren Anzahl und Abst\xe4nde f\xfcr das Atom charakteristisch ist."]),t.s)
B.Kx=A.a(s(["At low temperatures (here: 300K), the atom is in a low-energy state. In the atomic model shown, the electron is located on the inner shell.","Increasing the temperature causes the electron to move to a shell further out. This corresponds to an excited energy state.","If the possible energy values W that the atom can assume are plotted in a simple diagram, this results in several discrete states (energy lines), the number and spacing of which is characteristic of the atom."]),t.s)
B.yP=new A.c_("Atome k\xf6nnen unterschiedliche Energiezust\xe4nde annehmen. Dieses Applet zeigt in einer stark vereinfachten Darstellung einen Atomkern (rot) mit einem Valenzelektron (blau), welches durch Zuf\xfchren von W\xe4rmeenergie angeregt wird.\n\nMan sieht:\n",B.GY,"Atoms can assume different energy states. This applet shows a highly simplified representation of an atomic nucleus (red) with a valence electron (blue), which is excited by the application of thermal energy.\n        \nYou can see:\n        ",B.Kx,null)
B.Id=A.a(s(["Ist im Valenzband eine L\xfccke (auch Defektelektron oder Loch genannt) entstanden, so k\xf6nnen benachbarte Elektronen in diese L\xfccke springen (obere Grafik), was einem Ladungstransport und damit einem Stromfluss entspricht.","Die Bewegung der nachr\xfcckenden Elektronen (hier: Bewegung negativer Ladung von rechts nach links) hat den gleichen Effekt wie eine sich in die andere Richtung (also von links nach rechts) bewegende positive Ladung (untere Grafik).","Ein fehlendes Elektron, d.h. allgemein ein Zustand, der nicht von einem Elektron besetzt ist, kann daher als ein eigenes Teilchen mit positiver Ladung, ein so genanntes Loch, betrachtet werden.","Neben der Anzahl der freien Elektronen im Leitungsband ist daher auch die Anzahl der freien L\xf6cher im Valenzband wesentlich f\xfcr die elektrischen Eigenschaften des Halbleiters verantwortlich, da beide Ladungstr\xe4gerarten zum Stromtransport beitragen k\xf6nnen."]),t.s)
B.IE=A.a(s(["If there is a gap (also called a defect electron or hole) in the valence band, neighboring electrons can jump into this gap (upper diagram), which corresponds to a charge transport and thus a current flow","The movement of the following electrons (here: movement of negative charge from right to left) has the same effect as a positive charge moving in the other direction (i.e. from left to right) (lower diagram)","A missing electron, i.e. generally a state that is not occupied by an electron, can therefore be regarded as a separate particle with a positive charge, a so-called hole","In addition to the number of free electrons in the conduction band, the number of free holes in the valence band is therefore also essentially responsible for the electrical properties of the semiconductor, since both types of charge carriers can contribute to current transport"]),t.s)
B.yQ=new A.c_('Bricht durch Zufuhr von Energie eine Bindung im undotierten Halbleiter auf, d.h. gelangt im B\xe4nderdiagramm ein Elektron vom Valenzband in das Leitungsband, so kann es sich frei bewegen und zum Ladungstransport beitragen. Doch auch die entstandene "L\xfccke" (das Loch) kann zum Ladungstransport beitragen, indem in diese L\xfccke ein anderes Elektronen nachr\xfcckt, welches daraufhin an einer anderen Stelle ein Loch hinterl\xe4sst. Das Loch "wandert" also gleichsam durch den Halbleiter. Das folgende Applet zeigt die zwei m\xf6glichen Betrachtungsweisen des Ladungstransports im Valenzband. Die obere Abbildung zeigt die Bewegung der Elektronen (Elektronenkonzept), die untere stellt den Vorgang durch die Bewegung der "L\xfccke" dar (L\xf6cherkonzept).\n\nMan sieht:\n',B.Id,'If a bond in the undoped semiconductor is broken by supplying energy, i.e. an electron moves from the valence band to the conduction band in the band diagram, it can move freely and contribute to charge transport. However, the resulting "gap" (the hole) can also contribute to charge transport by another electron moving into this gap, which then leaves a hole at a different position. The hole therefore "wanders" through the semiconductor. The following applet shows the two possible ways of looking at charge transport in the valence band. The upper illustration shows the movement of the electrons (electron concept), the lower illustrates the process through the movement of the "gap" (hole concept).\n\nYou can see:\n',B.IE,null)
B.KJ=A.a(s(["Das Anlegen einer Drain-Source Spannung UDS f\xfchrt nur dann zu einem Strom IDS durch den Transistor, wenn die Gate-Source Spannung UGS gr\xf6\xdfer ist als die Einsatzspannung Uth,n, da sich erst dann ein leitender Kanal unter dem Gate bildet.","\xdcberschreitet die Gate-Source Spannung UGS die Einsatzspannung Uth,n, so bildet sich ein leitender Kanal unterhalb des Gates und es kann ein Strom flie\xdfen, wenn eine Spannung UDS angelegt wird.","Der Strom IDS steigt - bei konstantem UGS - zun\xe4chst mit gr\xf6\xdfer werdender Spannung UDS stark an. Diesen Bereich bezeichnet man als Widerstandsbereich.","Mit gr\xf6\xdfer werdender Spannung UDS erreicht der Strom jedoch einen S\xe4ttigungswert und steigt dann nur noch geringf\xfcgig an. Dieser Bereich wird als S\xe4ttigungsbereich bezeichnet."]),t.s)
B.Jb=A.a(s(["Applying a drain-source voltage UDS only causes a current IDS to flow through the transistor if the gate-source voltage UGS is greater than the threshold voltage Uth,n, because only then does a conducting channel form under the gate.","If the gate-source voltage UGS exceeds the threshold voltage Uth,n, a conducting channel is formed below the gate and a current can flow when a voltage UDS is applied.","The current IDS initially increases sharply with increasing voltage UDS, provided that the gate-source voltage UGS remains constant. This range is known as the resistance range.","However, as the voltage UDS increases, the current reaches a saturation value and then increases only slightly. This range is referred to as the saturation range."]),t.s)
B.yR=new A.EW(null)
B.IL=A.a(s(["F\xfcr die gezeigte Anordnung eines gegengekoppelten Verst\xe4rkers, bei dem ein Teil k des Ausgangssignals wieder mit umgekehrtem Vorzeichen auf den Eingang zur\xfcckgef\xfchrt wird, ergibt sich allgemein eine Gesamtverst\xe4rkung ua/ue von:"]),t.s)
B.K4=A.a(s(["For the arrangement of a negative feedback amplifier shown, in which part k of the output signal is fed back to the input with the opposite sign, the overall amplification ua/ue is generally given by:"]),t.s)
B.yS=new A.EX(null)
B.JW=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T1 und T2 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T3.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes IC,A durch T2 und T3 sowie der Ausgangsspannung UCE,A im Arbeitspunkt.","Der Arbeitspunkt, d.h. der Strom IC,A durch die Transistoren T2 und T3 sowie die Spannung UCE,A am Ausgang der Schaltung l\xe4sst sich bei einer vorgegebenen Spannung UBE,A durch den Transistorparameter IS3 beeinflussen. IS3 kann dabei z.B. \xfcber die Gr\xf6\xdfe des Transistors T3 eingestellt werden.","Der Strom IC,A ist dabei im Wesentlichen durch den Stromspiegel T1 und T2 eingepr\xe4gt und \xe4ndert sich daher auch bei \xc4nderungen des Transistorparameters IS3 nur sehr wenig.","Die Spannung UCE,A im Arbeitspunkt reagiert jedoch sehr empfindlich auf \xc4nderungen des Parameters IS3. Diese Empfindlichkeit wird um so gr\xf6\xdfer, je geringer der Early-Effekt ist, d.h. je gr\xf6\xdfer die Early-Spannung Uan ist."]),t.s)
B.IK=A.a(s(["The blue curve corresponds to the characteristic curve of the current mirror T1 and T2 and thus represents the load curve. The red curve corresponds to the output characteristic curve of the amplifier transistor T3.","The intersection of the two curves provides the value of the current IC,A through T2 and T3 and the output voltage UCE,A at the operating point.","The operating point, i.e. the current IC,A through the transistors T2 and T3 and the voltage UCE,A at the output of the circuit, can be influenced by the transistor parameter IS3 at a given voltage UBE,A. IS3 can be adjusted, for example, by the size of the transistor T3.","The current IC,A is essentially impressed by the current mirror T1 and T2 and therefore changes very little even when the transistor parameter IS3 changes.","The voltage UCE,A at the operating point, however, reacts very sensitively to changes in the parameter IS3. This sensitivity increases the lower the early effect is, i.e. the higher the early voltage Uan is."]),t.s)
B.yT=new A.c_("Dieses Applet veranschaulicht die Arbeitspunkteinstellung bei einem Verst\xe4rker mit Stromspiegel.\n\nMan sieht:\n",B.JW,"This applet illustrates the setting of the operating point of an amplifier with a current mirror.\n\nYou can see:\n",B.IK,null)
B.Kq=A.a(s(["Werden Metall und Halbleiter in Kontakt gebracht, so muss im thermodynamischen Gleichgewicht das Ferminiveau Wf in beiden Materialien auf einer H\xf6he verlaufen. Entsprechend m\xfcssen daher die beiden B\xe4nderdiagramme vertikal gegeneinander verschoben werden, was zu einer Verbiegung der B\xe4nder im Bereich des \xdcbergangs f\xfchrt.","Fall 1: Schottky-Kontakt\nBei einem n-Typ-Halbleiter ergibt sich durch die Verbiegung der B\xe4nder eine Spitze in der Leitungsbandkante Wc, die f\xfcr Elektronen eine Potentialbarriere darstellt, welche nicht ohne Weiteres \xfcberwunden werden kann. Bei einem p-Typ-Halbleiter hingegen ergibt sich eine Potentialbarriere in der Valenzbandkante Wv, die von L\xf6chern nicht ohne Weiteres \xfcberwunden werden kann.","Fall 2: Ohmscher Kontakt\nDie Bandverbiegung im Bereich des \xdcbergangs f\xfchrt nicht zu einer Potentialbarriere, d.h. die Ladungstr\xe4ger k\xf6nnen ungehindert von einem Gebiet in das andere gelangen; der Strom wird nur durch den ohmschen Widerstand der neutralen Bahngebiete bestimmt."]),t.s)
B.GW=A.a(s(["When metal and semiconductor are brought into contact, the Fermi level Wf in both materials must be at the same level in thermodynamic equilibrium. Accordingly, the two band diagrams must be vertically shifted against each other, which leads to a bending of the bands in the transition region.","Case 1: Schottky contact\nIn an n-type semiconductor, the bending of the bands results in a peak in the conduction band edge Wc, which represents a potential barrier for electrons that cannot be overcome without further ado. In a p-type semiconductor, on the other hand, a potential barrier is created in the valence band edge Wv, which cannot be overcome by holes without further ado.","Case 2: Ohmic contact\nThe band bending in the transition region does not lead to a potential barrier, i.e. the charge carriers can pass from one region to the other without hindrance; the current is only determined by the ohmic resistance of the neutral path regions."]),t.s)
B.yU=new A.c_('In diesem Applet wird die Konstruktion des B\xe4nderdiagramms eines Metall-Halbleiter-Kontaktes animiert dargestellt. Dabei kann ausgew\xe4hlt werden, ob der entstehende Kontakt ein dioden\xe4hnliches Verhalten (Schottky) oder aber ein ohmsches Verhalten (ohmic) aufweisen soll. Weiterhin kann die Dotierung des Halbleiters (n-type oder p-type) festgelegt werden. Bei einem n-Halbleiter werden die Eigenschaften des Kontaktes durch das Verhalten der Elektronen bestimmt, die sich entlang der Leitungsbandkante Wc bewegen. Bei einem p-Halbleiter hingegen bestimmen die sich entlang der Valenzbandkante Wv bewegenden L\xf6cher die Eigenschaften des Kontaktes. Zun\xe4chst werden die B\xe4nderdiagramme f\xfcr das Metall und f\xfcr den Halbleiter getrennt dargestellt. Das Vakuumniveau Wo dient dabei als gemeinsames Bezugsniveau. Nach Bet\xe4tigung der Schaltfl\xe4che "Start" werden die beiden Materialien miteinander in Kontakt gebracht. Im oberen Panel des Applets werden die Verl\xe4ufe der Energieb\xe4nder dargestellt. Das untere Panel zeigt die zugeh\xf6rige Verteilung der Ladungsdichte .\n\nMan sieht:\n',B.Kq,'This applet shows an animated representation of the construction of the band diagram of a metal-semiconductor contact. You can choose whether the resulting contact should exhibit diode-like behavior (Schottky) or ohmic behavior. You can also specify the doping of the semiconductor (n-type or p-type). In the case of an n-type semiconductor, the properties of the contact are determined by the behavior of the electrons moving along the conduction band edge Wc. In the case of a p-type semiconductor, on the other hand, the holes moving along the valence band edge Wv determine the properties of the contact. First, the band diagrams for the metal and for the semiconductor are displayed separately. The vacuum level Wo serves as a common reference level. After clicking the "Start" button, the two materials are brought into contact with each other. The upper panel of the applet shows the energy band curves. The lower panel shows the corresponding distribution of charge density .\n        \nYou can see:',B.GW,null)
B.JA=A.a(s(["Jedes der Siliziumatome hat vier Valenzen, die r\xe4umlich ausgerichtet sind, so dass sich benachbarte Atome bevorzugt in diesen Richtungen anlagern. Dadurch entsteht eine regelm\xe4\xdfige Struktur, das so genannte Kristallgitter."]),t.s)
B.K7=A.a(s(["Each of the silicon atoms has four valences, which are spatially aligned so that neighboring atoms prefer to attach in these directions. This creates a regular structure, the so-called crystal lattice."]),t.s)
B.yV=new A.c_("Das folgende Applet zeigt die dreidimensionale Struktur eines Siliziumkristalls, bestehend aus mehreren Siliziumatomen. Durch Ziehen mit der Maus kann der Kristall r\xe4umlich gedreht werden.\n\nMan sieht:\n",B.JA,"The following applet shows the three-dimensional structure of a silicon crystal consisting of several silicon atoms. The crystal can be rotated spatially by dragging it with the mouse.\n\nYou can see:\n",B.K7,null)
B.K3=A.a(s(["Durch die Injektion zus\xe4tzlicher Ladungstr\xe4ger am linken Rand der Probe entsteht ein Konzentrationsgef\xe4lle, aufgrund dessen eine Diffusionsbewegung der Ladungstr\xe4ger von links nach rechts einsetzt.","Durch die Erh\xf6hung der Ladungstr\xe4gerdichten steigt die Rekombinationsrate R (R ~ n*p), so dass \xfcbersch\xfcssige Ladungstr\xe4ger paarweise rekombinieren. Die Tr\xe4gerdichten nehmen mit zunehmender Entfernung von der Injektionsstelle also wieder ab, bis sie schlie\xdflich sehr weit rechts von der Injektionsstelle wieder die Gleichgewichtswerte (n=n0 bzw. p=p0) erreicht haben.","Das gleiche Ergebnis h\xe4tte man erhalten, wenn man nur Minorit\xe4tstr\xe4ger (hier: L\xf6cher) injiziert h\xe4tte. Wegen des sich dann ergebenden Ladungsungleichgewichtes und dem dadurch hervorgerufenen elektrischen Feld h\xe4tte sich \"sofort\" (genauer: innerhalb der so genannten \"dielektrischen Relaxationszeit\") eine gleiche Anzahl zus\xe4tzlicher Elektronen aus dem n-Halbleiter angefunden, so dass gilt n'=p'. Die Minorit\xe4tstr\xe4ger bestimmen in diesem Experiment also im Wesentlichen das Verhalten des Halbleiters, insbesondere wird der abnehmende Verlauf der \xdcberschussladungstr\xe4gerdichten n' bzw p' allein durch die Minorit\xe4tstr\xe4gerlebensdauer bestimmt.","Tr\xe4gt man die Dichte der \xdcberschussladungstr\xe4ger p'=n' \xfcber dem Ort x auf, so ergibt sich eine abklingende Exponentialfunktion mit der Abklingkonstanten Lp, der so genannten Diffusionsl\xe4nge, welche proportional zu der Lebensdauer der Minorit\xe4tstr\xe4ger ist. Die Diffusionsl\xe4nge Lp kann demnach als die von den Ladungstr\xe4gern w\xe4hrend der Lebensdauer im Mittel zur\xfcckgelegten Strecke interpretiert werden.","Eine \xc4nderung der Minorit\xe4tstragerlebensdauer bzw. der Diffusionsl\xe4nge f\xfchrt zu einer \xc4nderung der Verteilung der Ladungstr\xe4ger und damit auch zu einer \xc4nderung der in dem Halbleiter gespeicherten Ladungsmenge."]),t.s)
B.Jh=A.a(s(["The injection of additional charge carriers at the left edge of the sample creates a concentration gradient, which causes a diffusion movement of the charge carriers from left to right.","The increase in the charge carrier density causes the recombination rate R to rise (R ~ n*p), so that excess charge carriers recombine in pairs. The carrier densities therefore decrease again with increasing distance from the injection point until they finally reach the equilibrium values (n=n0 and p=p0) again very far to the right of the injection point.","The same result would have been obtained if only minority carriers (here: holes) had been injected. Due to the resulting charge imbalance and the electric field caused by it, an equal number of additional electrons would have \"immediately\" (more precisely: within the so-called \"dielectric relaxation time\") found their way out of the n-type semiconductor, so that n'=p' applies. In this experiment, the minority carriers essentially determine the behavior of the semiconductor, in particular the decreasing course of the excess carrier densities n' and p' is determined solely by the minority carrier lifetime.","If the density of the excess charge carriers p'=n' is plotted against the location x, a decaying exponential function with the decay constant Lp, the so-called diffusion length, is obtained, which is proportional to the lifetime of the minority carriers. The diffusion length Lp can therefore be interpreted as the distance covered by the charge carriers on average during their lifetime.","A change in the minority carrier lifetime or the diffusion length leads to a change in the distribution of the charge carriers and thus also to a change in the amount of charge stored in the semiconductor."]),t.s)
B.yW=new A.c_("Ebenso wie nach einer tempor\xe4ren St\xf6rung des thermodynamischen Gleichgewichtes (z.B. durch Lichteinstrahlung) strebt der Halbleiter auch bei einer lokalen St\xf6rung stets wieder den Gleichgewichtszustand an.\n\nDas folgende Applet zeigt das Verhalten einer n-Typ Halbleiterprobe bei einer lokalen St\xf6rung des TGGs durch st\xe4ndige Injektion von Elektronen und L\xf6chern am linken Rand (x=0) der Probe. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch Injektion zus\xe4tzlich vorhandenen Ladungstr\xe4ger (n' bzw. p') dargestellt.\n\nMan sieht:\n",B.K3,"Just as after a temporary disturbance of the thermodynamic equilibrium (e.g. due to light irradiation), the semiconductor always strives to return to the equilibrium state, even after a local disturbance.\n\nThe following applet shows the behavior of an n-type semiconductor sample when the TGG is locally disturbed by the continuous injection of electrons and holes at the left edge (x=0) of the sample. For the sake of clarity, only the additional charge carriers (n' and p') that are present due to the injection are shown in the semiconductor.\n\nYou can see:\n",B.Jh,null)
B.KD=A.a(s(["Ausgangspunkt der \xdcberlegungen ist das vereinfachte Ersatzschaltbild des zu kompensierenden Verst\xe4rkers mit den parasit\xe4ren Kapazit\xe4ten, welche die Polstellen der \xdcbertragungsfunktion a(jw) und damit den Frequenz- und Phasengang bestimmen. F\xfcr den zu untersuchenden kritischen Fall gr\xf6\xdftm\xf6glicher R\xfcckkopplung, d.h. k=1 bzw. 1/k=0dB, entspricht die Kurve |a(jw)| gleichzeitig der f\xfcr die Stabilit\xe4t wichtigen Schleifenverst\xe4rkung |a*k|. Die Frequenz wd, bei der der Betrag der Schleifenverst\xe4rkung gleich 1 ist, ergibt sich demnach aus dem Schnittpunkt der Kurve |a(jw)| mit der Frequenzachse.","F\xfcr den nicht kompensierten Verst\xe4rker sieht man, dass bei dieser Frequenz die Phase 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.","Eine M\xf6glichkeit, den Verst\xe4rker zu stabilisieren, ist nun, die Kapazit\xe4t C1 zu vergr\xf6\xdfern. Dadurch verschiebt sich der Pol w1 der \xdcbertragungsfunktion, womit eine \xc4nderung des Frequenz- und des Phasengangs einhergeht. Insbesondere erreicht man jedoch, dass durch den jetzt fr\xfcher einsetzenden Verst\xe4rkungsabfall die Frequenz wd zu niedrigeren Werten hin verschoben wird, bei denen die Phasendrehung noch keine 180 Grad betr\xe4gt. Der Verst\xe4rker bleibt somit stabil.","Nachteilig ist jedoch, dass zur Kompensation sehr gro\xdfe Kapazit\xe4tswerte im nF-Bereich n\xf6tig sind, was f\xfcr integrierte Operationsverst\xe4rker nicht akzeptabel ist. Eine bessere Methode zur Kompensation ist daher die so genannte Miller-Kompensation."]),t.s)
B.JZ=A.a(s(["The starting point for the considerations is the simplified equivalent circuit diagram of the amplifier to be compensated with the parasitic capacitances, which determine the poles of the transfer function a(jw) and thus the frequency and phase response. For the critical case of maximum feedback, i.e. k=1 or 1/k=0dB, the curve |a(jw)| corresponds to the loop gain |a*k|, which is important for stability. The frequency wd at which the absolute value of the loop gain is equal to 1 is therefore obtained from the intersection of the curve |a(jw)| with the frequency axis.","For the uncompensated amplifier, we can see that the phase reaches 180 degrees at this frequency, so the feedback amplifier would oscillate.","One way of stabilizing the amplifier is to increase the capacitance C1. This shifts the pole w1 of the transfer function, which in turn changes the frequency and phase response. In particular, however, the earlier onset of the gain reduction means that the frequency wd is shifted to lower values at which the phase shift is still less than 180 degrees. The amplifier thus remains stable.","The disadvantage, however, is that very large capacitance values in the nF range are required for compensation, which is not acceptable for integrated operational amplifiers. A better method of compensation is therefore the so-called Miller compensation."]),t.s)
B.yX=new A.EY(null)
B.Ky=A.a(s(["Bei dieser Art der Kompensation wird die Kompensationskapazit\xe4t Ck nicht parallel zu C1, sondern zwischen die beiden Verst\xe4rkerstufen eingef\xfcgt.","F\xfcr den nicht kompensierten Verst\xe4rker, d.h. Ck=0, sieht man, dass f\xfcr sehr hohe Frequenzen die Phasenverschiebung 180 Grad erreicht, der r\xfcckgekoppelte Verst\xe4rker w\xfcrde also schwingen.",'Durch Vergr\xf6\xdferung von Ck werden nun, da die beiden Verst\xe4rkerstufen nicht mehr unabh\xe4ngig voneinander sind, beide Pole beeinflusst. Insbesondere wandert der Pol p1 zu niedrigeren Frequenzen, wie es auch bereits bei der Kompensation durch Polverschiebung der Fall war. Zus\xe4tzlich verschiebt sich aber auch der Pol p2 zu h\xf6heren Frequenzen, so dass beide Pole weiter auseinanderstreben ("pole splitting") und damit der kritische Wert der Phasendrehung von 180 Grad erst bei h\xf6heren Frequenzen erreicht wird.',"Wichtigster Vorteil ist jedoch, dass bereits sehr kleine Werte von Ck ausreichen, um den Pol p1 zu verschieben. Der Grund daf\xfcr liegt darin, dass Ck zwischen beiden Verst\xe4rkerstufen liegt, und damit bereits kleine Spannungs\xe4nderungen an der Eingangsstufe gro\xdfe Spannungs\xe4nderungen \xfcber der Kapazit\xe4t bewirken. Diese wirkt dadurch wie eine um den Faktor der Spannungsverst\xe4rkung vergr\xf6\xdferte Kapazit\xe4t, die parallel zu C1 liegt (Miller-Effekt)."]),t.s)
B.HI=A.a(s(["With this type of compensation, the compensation capacitor Ck is not inserted in parallel with C1, but between the two amplifier stages.","For the uncompensated amplifier, i.e. Ck=0, it can be seen that the phase shift reaches 180 degrees for very high frequencies, so the feedback amplifier would oscillate.",'By increasing Ck, both poles are now influenced, since the two amplifier stages are no longer independent of each other. In particular, pole p1 moves to lower frequencies, as was already the case with compensation by pole shifting. In addition, the pole p2 also shifts to higher frequencies, so that both poles continue to diverge ("pole splitting") and the critical value of 180 degrees is only reached at higher frequencies.',"The most important advantage, however, is that even very small values of Ck are sufficient to shift the pole p1. The reason for this is that Ck is located between the two amplifier stages, and thus even small voltage changes at the input stage cause large voltage changes across the capacitance. This then acts like a capacitance that is increased by the factor of the voltage amplification and is located in parallel to C1 (Miller effect)."]),t.s)
B.yY=new A.EZ(null)
B.Kv=A.a(s(["Ersetzt man die imagin\xe4re Variable jw der \xdcbertragungsfunktion A(jw) formal durch die komplexe Gr\xf6\xdfe s=r+jw, so erh\xe4lt man eine Funktion A(s), die nun z.B. dem Betrag nach in der komplexen r-w Ebene dargestellt werden kann (unteres Bild). Man spricht in diesem Fall von analytischer Fortsetzbarkeit, da die urspr\xfcngliche Funktion mit imagin\xe4rem Argument ins Komplexe fortgesetzt wird. Dies ist auf Grund der Holomorphie rationaler Funktionen m\xf6glich.","Der Verlauf der Funktion |A(s)| in der komplexen Ebene ist durch die Lage der Null- und Polstellen eindeutig definiert. Insbesondere ist durch die Lage der Null- und Polstellen auch der Verlauf von |A(s)| f\xfcr r=0, d.h. entlang der Frequenzachse, festgelegt. Dies entspricht aber gerade dem Frequenzgang |A(jw)|, der f\xfcr positive Frequenzen, d.h. jw>0, im oberen Bild zur Verdeutlichung nochmals im logarithmischen Ma\xdfstab dargestellt ist.","Der Einfluss der Lage der Pole auf den Frequenzgang |A(jw)| wird deutlich, wenn in dem Beispiel der Parameter a und damit die Lage der Pole ge\xe4ndert wird. Verschieben sich diese z.B. f\xfcr kleiner werdendes a in Richtung der Frequenzachse (jw), so tritt im Frequenzgang eine deutliche \xdcberh\xf6hung auf. F\xfcr den Schaltungsentwickler interessant ist nun die Frage, welchen Einfluss Schaltungsparameter auf die Lage der Pole und damit auf den Frequenzgang der Schaltung haben."]),t.s)
B.Ij=A.a(s(["If the imaginary variable jw of the transfer function A(jw) is formally replaced by the complex quantity s=r+jw, a function A(s) is obtained that can now be represented, for example, in the complex r-w plane (lower figure). In this case, we speak of analytic continuability, since the original function with an imaginary argument is continued into the complex. This is possible due to the holomorphy of rational functions.","The course of the function |A(s)| in the complex plane is uniquely defined by the location of the zero and pole positions. In particular, the course of |A(s)| for r=0, i.e. along the frequency axis, is also determined by the location of the zero and pole positions. However, this corresponds exactly to the frequency response |A(jw)|, which is shown again in the upper illustration in logarithmic scale for positive frequencies, i.e. jw>0, for the sake of clarity.","The influence of the position of the poles on the frequency response |A(jw)| becomes clear when the parameter a and thus the position of the poles is changed in the example. If these shift towards the frequency axis (jw), for example for a that is becoming smaller, a clear peak occurs in the frequency response. The question of interest to the circuit designer is what influence the circuit parameters have on the location of the poles and thus on the frequency response of the circuit."]),t.s)
B.yZ=new A.F_(null)
B.Ho=A.a(s(["Wie bei der einfachen Bipolar-Verst\xe4rkerschaltung mit ohmscher Last kann die \xdcbertragungskennlinie auch f\xfcr aktive Lastelemente grafisch konstruiert werden, indem das Ausgangskennlinienfeld IDS=IDS(UDS,UGS) des Transistors und die entsprechende Kennlinie IDS(UDS) des Lastelementes in ein Diagramm eingetragen werden. Die Schnittpunkte der Kurven ergeben dann f\xfcr gegebene Werte der Eingangsspannung UGS die dazugeh\xf6rigen Werte der Ausgangsspannung UDS.","Abh\xe4ngig von dem Lastelement (Widerstand, Anreicherungs-, oder Verarmungstransistor) ergeben sich unterschiedliche \xdcbertragungskennlinien des Inverters. Die Kleinsignalspannungsverst\xe4rkung, die der Steigung dUDS/dUGS der \xdcbertragungskennlinie entspricht, h\xe4ngt stark von der Form der Lastkennlinie ab. Sie wird um so gr\xf6\xdfer, je flacher die Lastkennlinie verl\xe4uft, d.h. je gr\xf6\xdfer der differentielle Widerstand r=dUDS/dIDS des Lastelementes ist. In analogen Verst\xe4rkerschaltungen werden daher statt Widerst\xe4nden als Lastelement oft aktive Lasten eingesetzt."]),t.s)
B.JX=A.a(s(["As with the simple bipolar amplifier circuit with an ohmic load, the transfer characteristic can also be graphically constructed for active load elements by entering the output characteristic field IDS=IDS(UDS,UGS) of the transistor and the corresponding characteristic IDS(UDS) of the load element in a diagram. The intersections of the curves then give the corresponding values of the output voltage UDS for given values of the input voltage UGS.","The transfer characteristics of the inverter depend on the load element (resistor, enhancement or depletion transistor). The small-signal voltage gain, which corresponds to the slope dUDS/dUGS of the transfer characteristic, depends strongly on the shape of the load characteristic. It increases the flatter the load characteristic curve is, i.e. the greater the differential resistance r=dUDS/dIDS of the load element is. In analog amplifier circuits, active loads are therefore often used instead of resistors as load elements."]),t.s)
B.z_=new A.F0(null)
B.IJ=A.a(s(["Aus der \xdcbertragungskennlinie des Verst\xe4rkers erkennt man, dass ein Eingangssignal UBE nur im mittleren Bereich der Kennlinie verst\xe4rkt wird, in dem die Steigung dUCE/dUBE gro\xdf ist.","Um ein sinusf\xf6rmiges Eingangssignal mit der Amplitude ube verzerrungsfrei zu verst\xe4rken, muss diesem demnach ein Gleichanteil UBE0 \xfcberlagert werden, so dass das Eingangssignal stets im mittleren Bereich der Kennlinie verl\xe4uft. Der Gleichanteil UBE0 legt dabei den so genannten Arbeitspunkt der Verst\xe4rkerschaltung fest.","Liegt der Arbeitspunkt in der Mitte der Kennlinie, kann die Amplitude ube des Eingangssignals sehr gro\xdf gew\xe4hlt werden, ohne dass Begrenzungseffekte und damit Verzerrungen auftreten. Diese Betriebsart nennt man A-Betrieb.","Liegt der Arbeitspunkt auf dem Wert UBE0=0V, so spricht man vom B-Betrieb. Bei dieser Betriebsart wird die untere Halbwelle des Eingangssignals vollst\xe4ndig und die obere zum Teil abgeschnitten, das Signal also stark verzerrt.","Beim so genannten AB-Betrieb liegt der Arbeitspunkt UBE0 etwa im Knickpunkt der Kennlinie bei relativ kleinen Spannungen UBE0. Die untere Halbwelle des Eingangssignals wird zwar abgeschnitten, die obere Halbwelle des Eingangssignals wird jedoch bis hin zu sehr gro\xdfen Amplituden verzerrungsfrei \xfcbertragen.","Der C-Betrieb ist durch eine negative Vorspannung UBE0<0 gekennzeichnet. Diese Betriebsart wird z.B. bei Sender\xf6hren angewandt."]),t.s)
B.KL=A.a(s(["The transfer characteristic of the amplifier shows that an input signal UBE is only amplified in the middle range of the characteristic curve, where the slope dUCE/dUBE is large.","To amplify a sinusoidal input signal with an amplitude of ube without distortion, a DC component UBE0 must be superimposed on it so that the input signal always runs in the middle of the characteristic curve. The DC component UBE0 determines the so-called operating point of the amplifier circuit.","If the operating point is in the center of the characteristic curve, the amplitude ube of the input signal can be selected to be very large without limiting effects and thus distortions occurring. This operating mode is called A-mode.","If the operating point is at the value UBE0=0V, this is referred to as B-mode. In this operating mode, the lower half-wave of the input signal is completely cut off and the upper half-wave is partially cut off, so the signal is heavily distorted.","In the so-called AB mode, the operating point UBE0 is approximately at the inflection point of the characteristic curve at relatively low voltages UBE0. The lower half-wave of the input signal is cut off, but the upper half-wave of the input signal is transmitted without distortion up to very high amplitudes.","C-mode is characterized by a negative bias voltage UBE0<0. This mode is used, for example, in transmitter tubes."]),t.s)
B.z0=new A.c_(u.f,B.IJ,u.G,B.KL,null)
B.Ig=A.a(s(["Fall 1: Schottky-Kontakt mit n-typ Halbleiter\nIst die angelegte Spannung U positiv, verschiebt sich das Ferminiveau Wfm im Metall gem\xe4\xdf W = -q\xb7U nach unten, was zu einer entsprechenden Verbiegung der B\xe4nder f\xfchrt. Dadurch wird die Potentialbarriere kleiner, so dass Elektronen (blau dargestellt) vom Halbleiter in das Metall gelangen k\xf6nnen. Wird die Spannung weiter erh\xf6ht, sinkt die Barriere immer mehr ab und der Elektronenstrom kann entsprechend zunehmen.\nIst die Spannung U hingegen negativ, so verschiebt sich das Ferminiveau Wfm im Metall nach oben und die Potentialbarriere f\xfcr Elektronen erh\xf6ht sich, so dass praktisch keine Elektronen vom Halbleiter in das Metall gelangen k\xf6nnen, d.h. es kann kein Strom flie\xdfen. Tr\xe4gt man das beschriebene Strom-Spannungsverhalten auf, zeigt der untersuchte \xdcbergang im Wesentlichen ein dioden\xe4hnliches Verhalten.","Fall 2: Ohmscher Kontakt mit n-typ Halbleiter\nEs ist keine Potentialbarriere vorhanden, die einen Elektronenstrom verhindern k\xf6nnte. Somit k\xf6nnen bei positiver Spannung U Elektronen praktisch ungehindert vom Halbleiter ins Metall und bei negativer Spannung vom Metall in den Halbleiter gelangen. Der Strom wird dabei nur vom ohmschen Widerstand der neutralen Bahngebiete begrenzt."]),t.s)
B.GV=A.a(s(["Case 1: Schottky contact with n-type semiconductor\nIf the applied voltage U is positive, the Fermi level Wfm in the metal is shifted downwards according to W = -q\xb7U, which leads to a corresponding bending of the bands. This makes the potential barrier smaller, so that electrons (shown in blue) can pass from the semiconductor into the metal. If the voltage is increased further, the barrier drops more and more and the electron current can increase accordingly.\nIf the voltage U is negative, on the other hand, the Fermi level Wfm in the metal shifts upwards and the potential barrier for electrons increases, so that practically no electrons can pass from the semiconductor into the metal, i.e. no current can flow. If the current-voltage behavior described is plotted, the transition under investigation essentially shows diode-like behavior.","Case 2: Ohmic contact with n-type semiconductor\nThere is no potential barrier to prevent an electron current. This means that, with a positive voltage U, electrons can pass from the semiconductor to the metal practically unhindered, and with a negative voltage from the metal to the semiconductor. The current is limited only by the ohmic resistance of the neutral path regions."]),t.s)
B.z1=new A.F1(null)
B.Iv=A.a(s(["Eine Polstelle bewirkt einen Abfall des Betrages der \xdcbertragungsfunktion ab einer Grenzfrequenz, die von der Lage des Pols abh\xe4ngt. Je n\xe4her der Pol an der komplexen Achse liegt, um sehr niedriger ist die entsprechende Grenzfrequenz. Ebenfalls erfolgt eine Phasendrehung bei der Grenzfrequenz um -90 Grad.","Eine Nullstelle bewirkt einen Anstieg des Betrages der \xdcbertragungsfunktion sowie eine Phasendrehung um +90 Grad bei der zu der Nullstelle geh\xf6renden Grenzfrequenz.","Existieren mehrere Pol- oder Nullstellen, so \xfcberlagern sich deren Wirkungen. Insbesondere kompensieren sich Null- und Polstellen gegenseitig, wenn sie an der gleichen Stelle in der komplexen Ebene liegen.","Konjugiert komplexe Pole f\xfchren wegen des imagin\xe4ren Anteils zu Sinus- und Cosinus-Anteilen in der Sprungantwort. Der Realteil f\xfchrt zu einer exponentiellen D\xe4mpfung, wenn die Polstelle in der linken Halbebene liegt und zu einer ansteigenden Schwingung, wenn der Realteil des Poles positiv ist."]),t.s)
B.K2=A.a(s(["A pole causes a drop in the magnitude of the transfer function from a cut-off frequency that depends on the location of the pole. The closer the pole is to the complex axis, the lower the corresponding cut-off frequency. There is also a phase shift of -90 degrees at the cut-off frequency.","A zero causes an increase in the magnitude of the transfer function and a phase shift of +90 degrees at the zero's associated cut-off frequency.","If there are several poles or zeros, their effects will overlap. In particular, zeros and poles will cancel each other out if they are at the same point in the complex plane.","Conjugate complex poles lead to sine and cosine components in the step response due to the imaginary part. The real part leads to exponential damping if the pole is in the left half-plane and to an increasing oscillation if the real part of the pole is positive."]),t.s)
B.z2=new A.c_("Dieses Applet zeigt den Einfluss der Lage von Pol- (x) und Nullstellen (o) einer komplexen \xdcbertragungsfunktion auf den Amplituden- und Phasengang sowie die Sprungantwort. Im unteren, linken Fenster des Applets lassen sich Pol- und Nullstellen hinzuf\xfcgen, verschieben und l\xf6schen.\n        \nMan sieht: \n        ",B.Iv,"This applet shows the influence of the location of poles (x) and zeros (o) of a complex transfer function on the amplitude and phase response, as well as the step response. In the lower left window of the applet, poles and zeros can be added, moved and deleted.\n        \nYou can see: \n        ",B.K2,null)
B.HX=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Phosphor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (f\xfcnfwertige) P-Atome, so gehen jeweils vier der f\xfcnf Elektronen des Phosphor-Atoms (P) eine Bindung mit den benachbarten Si-Atomen ein; das f\xfcnfte Elektron bleibt jedoch ungebunden.",'Dieses f\xfcnfte Elektron, das keine Bindung eingegangen ist, kann bereits durch Zuf\xfchren geringer Ionisierungsenergie (z.B. geringe Temperaturerh\xf6hung) von dem Phosphor-Atom (P), dem so genannten Donator, gel\xf6st werden und wird dann zu einem "freien" Elektron. In dem B\xe4nderdiagramm entspricht diese geringe Ionisierungsenergie dem geringen Abstand des Donatorniveaus Wd zum Leitungsband Wc.',"Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (150K) alle Phosphoratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien Elektronen no gleich der Dichte ND der Dotierungsatome ist.","Der positive Atomrumpf (P+) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Durch das Dotieren erh\xf6ht sich demnach nur die Anzahl der freien Elektronen, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Wird die Temperatur weiter erh\xf6ht (T>300K) l\xf6sen sich - wie auch beim undotierten Halbleiter - immer mehr Bindungen zwischen den Si-Atomen und es entstehen zus\xe4tzliche Elektronen-Loch-Paare.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes, ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Phosphor dotierten Halbleiter die freien Elektronen ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem n-Typ Halbleiter."]),t.s)
B.JB=A.a(s(["If a silicon semiconductor is doped with phosphorus, i.e. if individual (tetravalent) Si atoms in the crystal lattice are replaced by (pentavalent) P atoms, four of the five electrons of the phosphorus atom (P) form a bond with the neighboring Si atoms; the fifth electron, however, remains unbound",'This fifth electron, which has not formed a bond, can be detached from the phosphorus atom (P), the so-called donor, by applying low ionization energy (e.g. a slight increase in temperature) and then becomes a "free" electron. In the band diagram, this low ionization energy corresponds to the small distance between the donor level Wd and the conduction band Wc',"Due to the low ionization energy, all phosphorus atoms are already ionized at very low temperatures (150K), so that in the technically relevant temperature range it can be assumed that the number of free electrons no is equal to the density ND of the dopant atoms","The positive atomic body (P+) is stationary and does not contribute to current transport in the semiconductor. Doping therefore only increases the number of free electrons that can move freely within the semiconductor","If the temperature is increased further (T>300K), more and more bonds between the Si atoms are broken - as with the undoped semiconductor - and additional electron-hole pairs are formed","The semiconductor always remains neutral to the outside, as each free charge carrier is opposed by an oppositely charged, stationary ion","As the free electrons in the phosphorus-doped semiconductor contribute significantly to the charge transport, it is also referred to as an n-type semiconductor"]),t.s)
B.z3=new A.c_("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Phosphor) die Anzahl der zum Stromtransport wichtigen freien Elektronen erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.HX,"This applet shows how doping a silicon semiconductor with suitable impurity atoms (here: phosphorus) can increase the number of free electrons that are important for current transport. The processes are shown both in the semiconductor crystal (left) and in the band diagram (right).\n\nYou can see:\n",B.JB,null)
B.II=A.a(s(["Bei negativen Spannungen zwischen Gate und Halbleitermaterial (UGB<0V) werden freie Ladungstr\xe4ger (L\xf6cher) aus dem p-dotierten Material von der negativen Elektrode angezogen, so dass eine Schicht positiver Ladung unterhalb des Gates entsteht. Auf dem Gate bildet sich eine entsprechende Gegenladung. Den sich einstellenden Zustand nennt man Akkumulation.","Bei einer positiven Spannung am Gate (UGB>0V) wandern die freien L\xf6cher von der positiven Elektrode weg. In dem ausger\xe4umten Gebiet verbleiben nur die (nicht gezeichneten) negativ ionisierten Dotierungsatome und es entsteht eine Raumladungszone. Diesen Zustand bezeichnet man als Verarmung.","Wird die Spannung am Gate weiter erh\xf6ht, so dass schlie\xdflich die Einsatzspannung \xfcberschritten wird (UGB>Uth,n), werden Elektronen-Loch Paare generiert, wobei die positiven L\xf6cher in das Substrat wandern, die negativen Elektronen jedoch von der positiven Elektrode angezogen werden, wo sie eine leitende Inversionsschicht bilden. Bei einem n-Kanal Feldeffekttransistor mit n-dotierten Source- und Drain-Anschl\xfcssen stellt dieser Elektronen-Kanal eine leitende Verbindung zwischen Source und Drain dar: Ein Feldeffekttransistor leitet also, wenn die Gate-Source Spannung die Einsatzspannung \xfcberschreitet."]),t.s)
B.Jc=A.a(s(["When there is a negative voltage between the gate and the semiconductor material (VGB<0V), free charge carriers (holes) from the p-doped material are attracted by the negative electrode, resulting in a layer of positive charge below the gate. A corresponding countercharge forms on the gate. The resulting state is called accumulation.","With a positive voltage at the gate (UGB>0V), the free holes move away from the positive electrode. Only the (not drawn) negatively ionized doping atoms remain in the cleared area, and a space charge zone is created. This state is called depletion.","If the voltage at the gate is increased further, so that the threshold voltage is finally exceeded (Vth>Vth,n), electron-hole pairs are generated, with the positive holes migrating into the substrate and the negative electrons being attracted to the positive electrode, where they form a conductive inversion layer. In an n-channel field-effect transistor with n-doped source and drain terminals, this electron channel represents a conductive connection between the source and drain: a field-effect transistor therefore conducts when the gate-source voltage exceeds the threshold voltage."]),t.s)
B.z4=new A.c_("Das folgende Applet zeigt das Verhalten einer MOS-Struktur beim Anlegen unterschiedlicher Spannungen. Eine MOS-Struktur besteht aus einem Halbleiter (hier p-Typ) mit einer isolierenden Oxidschicht, auf der eine Metallelektrode aufgebracht ist. Zwischen der Metallelektrode (G) und dem Halbleiter (B) kann eine Spannung angelegt werden. Nach Vorgabe der Spannung werden die freien Ladungstr\xe4ger innerhalb der Struktur und die Ladungsdichten dargestellt.\n\nMan sieht:\n",B.II,"The following applet shows the behavior of a MOS structure when different voltages are applied. A MOS structure consists of a semiconductor (here p-type) with an insulating oxide layer on which a metal electrode is applied. A voltage can be applied between the metal electrode (G) and the semiconductor (B). After the voltage has been specified, the free charge carriers within the structure and the charge densities are displayed.\n\nYou can see:\n",B.Jc,null)
B.Ko=A.a(s(["Bei gro\xdfen Kanall\xe4ngen sperrt der im Beispiel gezeigte Transistor, da die Spannung UGS (0,6V) unter der Einsatzspannung Uth (0,85V) liegt. In der B\xe4nderdiagrammdarstellung erkennt man dies an der Potenzialbarriere zwischen Source (S) und Bulk (B), die so hoch ist, dass dar\xfcber keine Elektronen von der Source zur Drainelektrode (D) gelangen k\xf6nnen.","Bei Kanall\xe4ngen kleiner 0,75um wird der geometrische Abstand zwischen Source (S) und Drain (D) so gering, dass sich die Potenzialbarriere - und damit auch die Einsatzspannung Uth - verringert. Bei L=0,25um ist die Einsatzspannung so niedrig (0,53V), dass bereits die angelegte Gate-Source Spannung von 0,6V ausreicht, um Elektronen \xfcber die Barriere zur Drain-Elektrode gelangen zu lassen. Bei Transistoren mit kurzer Kanall\xe4nge nimmt die Einsatzspannung daher mit kleiner werdender Kanall\xe4nge ab."]),t.s)
B.JC=A.a(s(["In the case of long channel lengths, the transistor shown in the example blocks, since the voltage UGS (0.6V) is below the threshold voltage Uth (0.85V). In the band diagram representation, this can be seen from the potential barrier between source (S) and bulk (B), which is so high that no electrons can pass from the source to the drain electrode (D).","For channel lengths smaller than 0.75um, the geometric distance between source (S) and drain (D) becomes so small that the potential barrier - and thus the threshold voltage Uth - decreases. At L=0.25um, the threshold voltage is so low (0.53V) that the applied gate-source voltage of 0.6V is already sufficient to allow electrons to pass the barrier to the drain electrode. In transistors with a short channel length, the threshold voltage therefore decreases as the channel length decreases."]),t.s)
B.z5=new A.c_("Das folgende Applet stellt den Kurzkanaleffekt mit Hilfe des B\xe4nderdiagramms dar. Die am Transistor anliegenden Spannungen sind vorgegeben; die Kanall\xe4nge kann eingestellt werden.\n\nMan sieht:\n",B.Ko,"The following applet shows the short-channel effect using a band diagram. The voltages applied to the transistor are given; the channel length can be adjusted.\n\nYou can see:\n",B.JC,null)
B.J_=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern des Bauelementes generiert, die zum Ladungstransport beitragen k\xf6nnen.","Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger, was wiederum eine Erh\xf6hung der Leitf\xe4higkeit bewirkt. Entsprechend sinkt die Leitf\xe4higkeit bei Verringerung der Bestrahlungsst\xe4rke.","Um die durch die Bestrahlung generierten Ladungstr\xe4ger im Innern des Bauelementes zu trennen und zu den Elektroden hin zu transportieren, ist ein elektrisches Feld E bzw. eine von au\xdfen angelegte Spannung U erforderlich.","Je h\xf6her diese Spannung U ist, desto gr\xf6\xdfer ist der Strom I durch den Fotowiderstand.","Der Strom I ist somit in guter N\xe4herung sowohl zu der Bestrahlungsst\xe4rke Ee als auch zu der angelegten Spannung U proportional, was zu der im Applet rechts gezeigten Widerstandsgeraden f\xfchrt, deren Steigung mit steigender Bestrahlungsst\xe4rke zunimmt.","Ohne Bestrahlung (Ee = 0) weist der Fotowiderstand eine von null verschiedene, geringe Leitf\xe4higkeit auf, d.h. bei einer angelegten Spannung flie\xdft ein geringer Dunkelstrom (der jedoch im linken Teil des Applets nicht animiert ist)."]),t.s)
B.ID=A.a(s(["Irradiation generates charge carrier pairs inside the device that can contribute to charge transport.","An increase in the irradiation intensity Ee leads to an increase in the generation rate and thus to a higher number of free charge carriers, which in turn causes an increase in conductivity. Accordingly, the conductivity decreases when the irradiation intensity is reduced.","An electric field E or an externally applied voltage U is required to separate the charge carriers generated by the irradiation inside the component and transport them to the electrodes.","The higher this voltage U is, the greater the current I through the photoresistor.","The current I is thus proportional to both the irradiance Ee and the applied voltage U, which leads to the straight line of resistance shown in the applet on the right, whose slope increases with increasing irradiance.","Without irradiation (Ee = 0), the photoresistor has a non-zero, low conductivity, i.e. a small dark current flows at an applied voltage (however, this is not animated in the left part of the applet)."]),t.s)
B.z6=new A.c_("Dieses Applet veranschaulicht die Funktion eines Fotowiderstandes. Die linke Seite des Applets zeigt eine schematische Darstellung des Fotowiderstandes, wobei aus Gr\xfcnden der \xdcbersichtlichkeit nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert werden. Die rechte Seite des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.J_,"This applet illustrates the function of a photoresistor. The left side of the applet shows a schematic representation of the photoresistor, with only the free charge carriers generated by irradiation being animated for the sake of clarity. The right side of the applet shows the current-voltage characteristic of the component, with the current operating point being marked by a red dot. The four buttons at the bottom of the applet can be used to vary the irradiation intensity Ee and the applied voltage U.\n\nYou can see:\n",B.ID,null)
B.HO=A.a(s(["Die blaue Kurve entspricht der Kennlinie des Stromspiegels T3 und T4 und stellt damit die Lastkurve dar. Die rote Kurve entspricht der Ausgangskennlinie des Verst\xe4rkertransistors T2.","Der Schnittpunkt der beiden Kennlinien liefert den Wert des Stromes durch die beiden Transistoren T2 und T4 sowie den Wert der Ausgangsspannung Ua. Die Ausgangsspannung im Arbeitspunkt kann bei der Schaltung z.B. auf den Wert Ua,A = 0V eingestellt werden.","Wegen des flachen Verlaufs der Kennlinien haben bereits kleine \xc4nderungen der Eingangsspannung Ue gro\xdfe Auswirkungen auf die Lage des Schnittpunktes der beiden Kurven und damit auf die Spannung Ua am Ausgang der Schaltung. Die Verst\xe4rkung dieser Schaltung f\xfcr Differenzeingangssignale ist daher sehr gro\xdf.","Da die Verst\xe4rkung um so gr\xf6\xdfer ist, je flacher die Steigung der Kennlinien ist, steigt die Verst\xe4rkung mit zunehmendem Ausgangswiderstand r0, d.h. mit abnehmendem Kanall\xe4ngenmodulationsfaktor Lambda der Transistoren."]),t.s)
B.I3=A.a(s(["The blue curve corresponds to the characteristic curve of the current mirror T3 and T4 and thus represents the load curve. The red curve corresponds to the output characteristic curve of the amplifier transistor T2.","The intersection of the two characteristic curves provides the value of the current through the two transistors T2 and T4 and the value of the output voltage Ua. The output voltage at the operating point can be set to the value Ua,A = 0V in the circuit, for example.","Due to the flatness of the characteristic curves, even small changes in the input voltage Ue have a major impact on the position of the intersection point of the two curves and thus on the voltage Ua at the output of the circuit. The gain of this circuit for differential input signals is therefore very high.","Since the amplification is all the greater the flatter the gradient of the characteristic curves, the amplification increases with increasing output resistance r0, i.e. with decreasing channel length modulation factor lambda of the transistors."]),t.s)
B.z7=new A.c_("Dieses Applet veranschaulicht die Funktion des Differenzverst\xe4rkers mit Stromspiegel bei Ansteuerung mit Differenzsignalen.\n\nMan sieht:\n",B.HO,"This applet illustrates the function of the differential amplifier with current mirror when driven by differential signals.\n\nYou can see:\n",B.I3,null)
B.Kf=A.a(s(["Frei bewegliche Teilchen f\xfchren bei Temperaturen T>0K thermische Bewegungen aus, deren Betrag und Richtung statistisch verteilt sind.","Betrachtet man zun\xe4chst nur die linke Kammer, so ist in dieser die Teilchenkonzentration \xfcberall konstant. Im Mittel heben sich demnach die thermischen Bewegungen der Teilchen gegenseitig auf.","Wird die Trennung zwischen den Kammern entfernt, so entsteht an dieser Stelle ein sehr gro\xdfer Konzentrationsgradient dn/dx. In diesem Bereich heben sich die thermischen Bewegungen nicht mehr gegenseitig auf und es kommt zu einem Zerflie\xdfen des Teilchenhaufens, so lange, bis die Teilchenkonzentration wieder \xfcberall konstant ist.","Dieser Diffusionsvorgang durch thermische Bewegung ist unabh\xe4ngig von der Ladung der Teilchen. Handelt es sich jedoch um freie Elektronen oder L\xf6cher, so f\xfchrt die Diffusionsbewegung zu einem Diffusionsstrom. Dieser ist proportional dem Gradienten der Ladungstr\xe4gerverteilung dn/dx und der Temperatur T."]),t.s)
B.HJ=A.a(s(["At temperatures T>0K, freely moving particles perform thermal movements whose magnitude and direction are statistically distributed","If we initially consider only the left-hand chamber, the particle concentration in this chamber is constant everywhere. On average, therefore, the thermal movements of the particles cancel each other out","If the separation between the chambers is removed, a very large concentration gradient dn/dx is created at this point. In this area, the thermal movements no longer cancel each other out and the cluster of particles melts until the particle concentration is constant everywhere again","This diffusion process through thermal movement is independent of the charge of the particles. However, if the particles are free electrons or holes, the diffusion movement leads to a diffusion current. This is proportional to the gradient of the charge carrier distribution dn/dx and the temperature T."]),t.s)
B.z8=new A.c_("Dieses Applet veranschaulicht den Vorgang der Diffusion.\n\nMan sieht:\n",B.Kf,"This applet illustrates the process of diffusion.\n\nYou can see:\n",B.HJ,null)
B.GT=A.a(s(["Der Wert der Raumladungsdichte wird durch die Dotierung in dem entsprechenden Gebiet bestimmt, also durch ND im n-Gebiet und durch NA im p-Gebiet.","Aus Neutralit\xe4tsgr\xfcnden m\xfcssen sich die Ladungen im p- und n-Gebiet gegenseitig kompensieren, d.h. die Fl\xe4chen unter den Rechtecken m\xfcssen gleich gro\xdf sein.","Daraus folgt, dass sich die Raumladungszone um so weiter in den Halbleiter erstreckt, je geringer die Dotierung ist. Gleichzeitig wird die Raumladung und damit das elektrische Feld kleiner."]),t.s)
B.IX=A.a(s(["The value of the space charge density is determined by the doping in the corresponding region, i.e. by ND in the n-region and by NA in the p-region.","For reasons of neutrality, the charges in the p and n regions must compensate each other, i.e. the areas under the rectangles must be the same size.","It follows that the space charge zone extends further into the semiconductor the lower the doping. At the same time, the space charge and thus the electric field become smaller."]),t.s)
B.z9=new A.c_("Dieses Applet zeigt, wie sich die Raumladungszone eines pn-\xdcberganges mit den Dotierungsdichten NA und ND des p- und des n-Gebietes \xe4ndert.\n\nMan sieht:\n",B.GT,"This applet shows how the space charge region of a pn junction changes with the doping densities NA and ND of the p- and n-regions.\n        \nYou can see:\n",B.IX,null)
B.Ih=A.a(s(["Liegt keine \xe4u\xdfere Spannung \xfcber der Struktur (U=0V), ist der pn-\xdcbergang im thermodynamischen Gleichgewicht (TGG). In der gezeigten B\xe4nderdiagrammdarstellung liegt das Ferminiveau Wf im TGG \xfcberall auf gleicher H\xf6he. In diesem Fall liegen auch die Pegel der Elektronen im p- und im n-Gebiet auf gleicher H\xf6he, so dass keine Netto-Ausgleichsbewegung, d.h. Bewegung von Elektronen von einem Gebiet in das andere, erfolgt. Entsprechendes gilt f\xfcr die L\xf6cher, deren Pegel ebenfalls auf gleichem Niveau liegen.","Durch das Anlegen einer \xe4u\xdferen elektrischen Spannung U>0V an die Struktur verschieben sich die Bandkanten gem\xe4\xdf U=-W/q, wobei in der Darstellung der Anschaulichkeit halber der ohmsche Spannungsabfall im Halbleitermaterial (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm) vernachl\xe4ssigt ist. Der Pegel der Elektronen im n-Gebiet liegt in diesem Fall \xfcber dem der Elektronen in p-Gebiet, so dass Elektronen durch die Raumladungszone in das p-Gebiet wandern. Diese \xfcbersch\xfcssigen Elektronen f\xfchren zu einer lokalen St\xf6rung des TGG, und damit einer Zunahme der Rekombination (G<R) der \xfcbersch\xfcssigen Elektronen mit L\xf6chern, die st\xe4ndig aus dem p-Gebiet nachgeliefert werden, was einem Stromfluss entspricht. Entsprechende \xdcberlegungen gelten f\xfcr die L\xf6cher, deren Pegel im p-Gebiet unter dem im n-Gebiet liegt.","Bei einer Spannung U<0V verschieben sich die B\xe4nder in umgekehrte Richtung, so dass nun Minorit\xe4tstr\xe4ger \xfcber die Raumladungszone in das benachbarte Gebiet gelangen k\xf6nnen. Wegen der sehr geringen Tr\xe4gerdichte der Minorit\xe4tstr\xe4ger wandern jedoch nur sehr wenige Ladungstr\xe4ger durch die Raumladungszone, was einem sehr kleinen Strom entspricht, der auch mit zunehmender Sperrspannung nicht wesentlich ansteigt."]),t.s)
B.Hp=A.a(s(["If there is no external voltage across the structure (U=0V), the pn junction is in thermodynamic equilibrium (TGE). In the band diagram shown, the Fermi level Wf is at the same height throughout the TGE. In this case, the levels of the electrons in the p and n regions are also at the same level, so that no net equalization movement, i.e. movement of electrons from one region to the other, occurs. The same applies to the holes, whose levels are also at the same level.","When an external voltage U>0V is applied to the structure, the band edges shift according to U=-W/q, whereby the ohmic voltage drop in the semiconductor material (see illustration of charge carrier transport in the band diagram) is neglected for the sake of clarity. In this case, the level of the electrons in the n-type region is higher than that of the electrons in the p-type region, so that electrons migrate through the space charge zone into the p-type region. These excess electrons lead to a local disturbance of the TGG, and thus to an increase in the recombination (G<R) of the excess electrons with holes, which are constantly supplied from the p-region, which corresponds to a current flow. The same considerations apply to the holes, whose level in the p-region is below that in the n-region.","At a voltage U<0V, the bands shift in the opposite direction, so that minority carriers can now pass through the space charge region into the neighboring region. However, due to the very low carrier density of the minority carriers, only very few charge carriers pass through the space charge region, which corresponds to a very small current that does not increase significantly even with increasing reverse voltage."]),t.s)
B.za=new A.c_("Dieses Applet zeigt f\xfcr einen pn-\xdcbergang die Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.Ih,"This applet shows the charge carrier transport in a band diagram for a pn junction, depending on the applied voltage.\n        \nYou can see:\n",B.Hp,null)
B.If=A.a(s(["W\xe4hlt man UBE=0V, so liegen die Ferminiveaus Wf in Emitter und Basis auf gleicher H\xf6he. Wegen UCE=+1V liegt das Ferminiveau im Kollektor gem\xe4\xdf W = -q\xb7U unterhalb der Ferminiveaus in Emitter und Basis. Aufgrund der unterschiedlichen Dotierungen von Emitter und Basis liegen die Bandkanten Wv und Wc in diesen Bereichen relativ zum Ferminiveau auf unterschiedlicher H\xf6he. Dadurch ergibt sich eine Potenzialbarriere, die die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von dem n-dotierten Emitter in den n-dotierten Kollektor bewegen.","Erh\xf6ht man nun die Basis-Emitter-Spannung UBE, so verringert sich die Potenzialbarriere zwischen Emitter und Basis. Elektronen, die im Emitter als Majorit\xe4tstr\xe4ger zahlreich zur Verf\xfcgung stehen, k\xf6nnen jetzt ungehindert vom Emitter \xfcber die Basis in den Kollektor gelangen. Es flie\xdft ein Strom."]),t.s)
B.I1=A.a(s(["If UBE=0V, the Fermi levels Wf in the emitter and base are at the same level. Due to UCE=+1V, the Fermi level in the collector is below the Fermi levels in the emitter and base, according to W = -q\xb7U. Due to the different doping of the emitter and base, the band edges Wv and Wc in these areas are at different levels relative to the Fermi level. This results in a potential barrier that the electrons have to overcome when they move from the n-doped emitter to the n-doped collector.","If the base-emitter voltage UBE is increased, the potential barrier between the emitter and the base is reduced. Electrons, which are available in large numbers in the emitter as majority carriers, can now pass unhindered from the emitter via the base into the collector. A current flows."]),t.s)
B.zb=new A.c_("Das folgende Applet zeigt die Funktionsweise des Bipolartransistors schematisch anhand des B\xe4nderdiagramms.\n\nMan sieht:\n",B.If,"The following applet shows how a bipolar transistor works, using a band diagram.\n\nYou can see:",B.I1,null)
B.HY=A.a(s(["F\xfcr UBE=0V und UCE=5V ist sowohl der Basis-Kollektor \xdcbergang als auch der Basis-Emitter \xdcbergang in Sperrrichtung gepolt, so dass kein Strom durch den Transistor flie\xdft, d.h. IE=IC=0.","Erh\xf6ht man die Basis-Emitter Spannung auf etwa UBE=0,7V, so wird der Basis-Emitter \xdcbergang in Durchlassrichtung gepolt. Dies f\xfchrt (vgl. Diode) zum einen dazu, dass L\xf6cher vom p-Gebiet (der Basis) in das n-Gebiet (den Emitter) diffundieren und dort rekombinieren. Zum anderen diffundieren Elektronen umgekehrt von dem n-Gebiet in die Basis. Da die Basisweite jedoch sehr klein ist, rekombinieren die Elektronen dort nicht, sondern gelangen bis in den n-dotierten Kollektor. Die angelegte Basis-Emitter Spannung f\xfchrt somit zu einem Elektronenstrom vom Emitter durch das Basisgebiet bis hin zum Kollektor."]),t.s)
B.JV=A.a(s(["For UBE=0V and UCE=5V, both the base-collector junction and the base-emitter junction are polarized in the reverse direction, so that no current flows through the transistor, i.e. IE=IC=0.","If the base-emitter voltage is increased to about UBE=0.7V, the base-emitter junction is polarized in the forward direction. This leads (cf. diode) on the one hand to holes diffusing from the p-type region (the base) into the n-type region (the emitter) and recombining there. On the other hand, electrons diffuse in the opposite direction from the n-type region into the base. However, since the base width is very small, the electrons do not recombine there, but instead reach the n-doped collector. The applied base-emitter voltage thus leads to an electron current from the emitter through the base region to the collector."]),t.s)
B.zc=new A.c_("Dieses Applet veranschaulicht die Funktion des Bipolartransistors.\n\nMan sieht:\n",B.HY,"This applet illustrates the function of the bipolar transistor.\n\nYou can see:",B.JV,null)
B.I2=A.a(s(["Bei undotierten Halbleitern liegt das Ferminiveau etwa in der Mitte des verbotenen Bandes.","Dotiert man den Halbleiter mit Donatoren (Erh\xf6hung von ND), so wandert der Schnittpunkt der beiden Kurven zur Leitungsbandkante Wc. Bei einer Dotierung mit Akzeptoren wandert das Ferminiveau entsprechend zur Valenzbandkante Wv.","Wird der Halbleiter sowohl mit Donatoren als auch mit Akzeptoren dotiert, so wird das Verhalten des Halbleiters (n- oder p-Typ) allein durch die Dotieratome mit der h\xf6heren Konzentration bestimmt.","Da f\xfcr einen undotierten Halbleiter die Tr\xe4gerdichten n0 und p0 gleich der Eigenleitungstr\xe4gerdichte ni sind und das Ferminiveau WF gleich dem Eigenleitungsniveau Wi ist, folgen unmittelbar die wichtigen Beziehungen:"]),t.s)
B.Kw=A.a(s(["In undoped semiconductors, the Fermi level is approximately in the middle of the forbidden band","If the semiconductor is doped with donors (increase of ND), the intersection of the two curves moves to the conduction band edge Wc. If the semiconductor is doped with acceptors, the Fermi level moves accordingly to the valence band edge Wv","If the semiconductor is doped with both donors and acceptors, the behavior of the semiconductor (n- or p-type) is determined solely by the dopant atoms with the higher concentration","Since for an undoped semiconductor the carrier densities n0 and p0 are equal to the intrinsic carrier density ni and the Fermi level WF is equal to the intrinsic level Wi, the important relationships follow immediately:"]),t.s)
B.zd=new A.F2(null)
B.JY=A.a(s(["Liegt das Ferminiveau in der Mitte zwischen Valenz- und Leitungsbandkante (undotierter Halbleiter), so sind die Kurven nw und pw symmetrisch zu Wf. Insbesondere sind die Fl\xe4chen unter den beiden Kurven und damit die Anzahl der freien Ladungstr\xe4ger n0 und p0 gleich gro\xdf.","Eine Erh\xf6hung der Temperatur f\xfchrt wegen des sich \xe4ndernden Verlaufes der Fermiverteilung zu einer Erh\xf6hung beider Tr\xe4gerdichten.","Bei einem n-dotierten Halbleiter, bei dem das Ferminiveau Wf und damit die gesamte Kurve F(W) nach oben verschoben ist, ergibt die Multiplikation und anschlie\xdfende Integration der Kurven einen h\xf6heren Wert f\xfcr die Elektronendichte n0 und einen kleineren Wert f\xfcr die L\xf6cherdichte p0. Umgekehrtes gilt f\xfcr einem p-Typ Halbleiter. Die Lage des Ferminiveaus Wf bestimmt also unmittelbar die Tr\xe4gerdichten im thermodynamischen Gleichgewicht."]),t.s)
B.KM=A.a(s(["If the Fermi level lies in the middle between the valence and conduction band edge (undoped semiconductor), the curves nw and pw are symmetrical to Wf. In particular, the areas under the two curves and thus the number of free charge carriers n0 and p0 are the same","An increase in temperature leads to an increase in both carrier densities due to the changing course of the Fermi distribution","For an n-doped semiconductor in which the Fermi level Wf and thus the entire curve F(W) is shifted upwards, multiplication and subsequent integration of the curves results in a higher value for the electron density n0 and a smaller value for the hole density p0. The reverse is true for a p-type semiconductor. The position of the Fermi level Wf therefore directly determines the carrier densities in thermodynamic equilibrium"]),t.s)
B.ze=new A.F3(null)
B.Ku=A.a(s(["Bei Upn=0 flie\xdft kein Strom durch die Diode, da sich die durch den Konzentrationsgradienten hervorgerufene Diffusionsbewegung und die durch das elektrische Feld in der Raumladungszone verursachte Driftbewegung der Ladungstr\xe4ger gerade aufheben.","Bei einer Spannung Upn>0 verringert sich das elektrische Feld in der Raumladungszone, so dass die Diffusion \xfcberwiegt. Dadurch diffundieren die Majorit\xe4tstr\xe4ger durch die Raumladungszone hindurch in das jeweils andere Gebiet wo sie schlie\xdflich mit den dortigen Majorit\xe4tstr\xe4gern rekombinieren. Letztere m\xfcssen daher st\xe4ndig aus den neutralen Gebieten nachgeliefert werden, so dass ein Strom I durch die Diode flie\xdft.","Mit zunehmender Spannung Upn dominiert die Diffusion immer mehr, so dass auch der Strom I immer gr\xf6\xdfer wird.","Wird die Diode in Sperrrichtung gepolt, dominiert wegen des gr\xf6\xdfer werdenden elektrischen Feldes der Driftstrom. Dieser f\xfchrt dazu, dass sich Minorit\xe4tstr\xe4ger durch die Raumladungszone bewegen. Wegen der sehr geringen Dichte der Minorit\xe4tstr\xe4ger ist der Strom jedoch sehr klein."]),t.s)
B.HT=A.a(s(["At Upn=0, no current flows through the diode, since the diffusion movement caused by the concentration gradient and the drift movement of the charge carriers caused by the electric field in the space charge zone cancel each other out.","At a voltage Upn>0, the electric field in the space charge region decreases, so that diffusion predominates. As a result, the majority carriers diffuse through the space charge region into the other region, where they finally recombine with the majority carriers there. The latter must therefore be constantly replenished from the neutral regions, so that a current I flows through the diode.","As the voltage Upn increases, diffusion becomes more and more dominant, so that the current I also increases.","If the diode is polarized in the reverse direction, the drift current dominates due to the increasing electric field. This causes minority carriers to move through the space charge region. However, the current is very small due to the very low density of minority carriers."]),t.s)
B.zf=new A.c_("Dieses Applet veranschaulicht die Funktion einer pn-Diode.\n\nMan sieht:\n",B.Ku,"This applet illustrates the function of a pn diode.\n\nYou can see:\n",B.HT,null)
B.Jz=A.a(s(["Bei sehr niedrigen Temperaturen sind alle Bindungen im Halbleiterkristall intakt. Es sind keine freien Elektronen vorhanden, die zum Stromtransport beitragen k\xf6nnen. In der B\xe4nderdiagrammdarstellung bedeutet dies, dass sich alle Elektronen im so genannten Valenzband befinden; das obere Energieband (Leitungsband) ist unbesetzt.","Wird die zum L\xf6sen einer Bindung n\xf6tige Energie (z.B. durch Erh\xf6hung der Temperatur) \xfcberschritten, entstehen freie Elektronen. Diese freien Elektronen befinden sich in der B\xe4nderdiagrammdarstellung im so genannten Leitungsband. Der Abstand von Leitungsband zu Valenzband, der Bandabstand Wg, entspricht dabei der Energie, die zugef\xfchrt werden muss, um eine Bindung zu l\xf6sen.","An den Stellen, wo vorher die jetzt freien Elektronen sa\xdfen, bleibt jeweils eine L\xfccke (ein so genanntes Loch) zur\xfcck. Diesem Loch kann - wegen der fehlenden negativen Ladung des Elektrons - eine positive Ladung zugeordnet werden. Da in diese L\xfccke wiederum andere Elektronen springen k\xf6nnen, tragen auch L\xf6cher zum Ladungstransport bei.","Durch das L\xf6sen von Bindungen zwischen Si-Atomen werden L\xf6cher und Elektronen paarweise generiert, so dass ihre Anzahl stets gleich gro\xdf ist.","Die Zahl der freien Ladungstr\xe4ger (Elektronen und L\xf6cher) in einem undotierten Halbleiter ist bei moderaten Temperaturen \xe4u\xdferst gering. Erst bei sehr hohen Temperaturen steigt die Anzahl der freien Ladungstr\xe4ger deutlich an. Durch Dotieren, d.h. den Einbau von Fremdatomen in den Halbleiter, kann jedoch die Zahl der freien L\xf6cher oder Elektronen gezielt ver\xe4ndert und bereits bei Raumtemperatur deutlich erh\xf6ht werden."]),t.s)
B.Iz=A.a(s(["At very low temperatures, all bonds in the semiconductor crystal are intact. There are no free electrons that can contribute to current transport. In the band diagram, this means that all electrons are in the so-called valence band; the upper energy band (conduction band) is unoccupied","If the energy required to break a bond is exceeded (e.g. by increasing the temperature), free electrons are created. These free electrons are located in the so-called conduction band in the band diagram. The distance from the conduction band to the valence band, the band gap Wg, corresponds to the energy that must be supplied to break a bond","At the places where the now free electrons were previously located, a gap (a so-called hole) remains. A positive charge can be assigned to this hole due to the missing negative charge of the electron. As other electrons can jump into this gap, holes also contribute to charge transport","By breaking bonds between Si atoms, holes and electrons are generated in pairs so that their number is always the same","The number of free charge carriers (electrons and holes) in an undoped semiconductor is extremely low at moderate temperatures. Only at very high temperatures does the number of free charge carriers increase significantly. However, by doping, i.e. incorporating foreign atoms into the semiconductor, the number of free holes or electrons can be specifically changed and significantly increased even at room temperature"]),t.s)
B.zg=new A.c_("Ein undotierter Silizium-Halbleiter besteht ausschlie\xdflich aus vierwertigen Siliziumatomen (Si), die in einer regelm\xe4\xdfigen Kristallstruktur angeordnet sind. Dabei gehen die vier Valenzelektronen eines jeden Siliziumatoms so genannte kovalente Bindungen mit den Elektronen der benachbarten Si-Atome ein. Das Applet zeigt das Verhalten eines undotierten Halbleiters bei \xc4nderung der Temperatur. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im so genannten B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.Jz,"An undoped silicon semiconductor consists exclusively of tetravalent silicon atoms (Si), which are arranged in a regular crystal structure. The four valence electrons of each silicon atom form so-called covalent bonds with the electrons of the neighboring Si atoms. The applet shows the behavior of an undoped semiconductor when the temperature changes. The processes are shown both in the semiconductor crystal (left) and in the so-called band diagram (right).\n\nYou can see:\n",B.Iz,null)
B.HR=A.a(s(["Eine Erh\xf6hung des Stromes IB0 am Eingang f\xfchrt zun\xe4chst zu einem Anstieg des Stromes IC im Ausgangskreis. Gleichzeitig verringert sich die Spannung UCE am Ausgang, da der Spannungsabfall \xfcber Rc gr\xf6\xdfer wird.","Erh\xf6ht man das Eingangssignal immer weiter, wird die Spannung UCE am Ausgang sehr klein, so dass die Basis-Kollektor Diode schlie\xdflich in Durchlassrichtung geschaltet wird und der Transistor in S\xe4ttigung geht. Dadurch verringert sich die Stromverst\xe4rkung B. Der Strom IC steigt dann trotz weiterer Zunahme von IB0 nicht mehr weiter an.","Wird der Eingang des Verst\xe4rkers mit einem Sinussignal angesteuert (AC on), so muss ein geeigneter Eingangsruhestrom IB0 eingestellt werden, damit das Sinussignal vollst\xe4ndig \xfcbertragen wird."]),t.s)
B.IG=A.a(s(["An increase in the current IB0 at the input initially leads to an increase in the current IC in the output circuit. At the same time, the voltage UCE at the output decreases, since the voltage drop across Rc increases.","If the input signal is increased further, the voltage UCE at the output becomes very small, so that the base-collector diode is finally switched in the forward direction and the transistor goes into saturation. This reduces the current gain B. The current IC then no longer increases despite a further increase in IB0.","If the amplifier input is driven by a sinusoidal signal (AC on), a suitable input bias current IB0 must be set so that the sinusoidal signal is transmitted in full."]),t.s)
B.zi=new A.c_("Dieses Applet veranschaulicht die Funktion eines Verst\xe4rkers mit Bipolartransistor.\n\nMan sieht:\n",B.HR,"This applet illustrates the function of an amplifier with a bipolar transistor.\n\nYou can see:\n",B.IG,null)
B.IB=A.a(s(["Abh\xe4ngig von der Lage des Ferminiveaus handelt es sich um einen p- oder n-Typ Halbleiter mit entsprechender Konzentration der Ladungstr\xe4gerdichten (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus).","Bei einer Spannung von U=0V liegt das Ferminiveau \xfcberall auf gleicher H\xf6he, der Halbleiter ist im thermodynamischen Gleichgewicht und es flie\xdft kein Strom durch den Halbleiter.","Das Anlegen einer elektrischen Spannung an den Halbleiter bewirkt eine Verschiebung der Bandkanten gem\xe4\xdf U=-W/q, so dass das Ferminiveau innerhalb des Halbleiters nicht mehr auf energetisch gleicher H\xf6he liegt, was einer St\xf6rung des thermodynamischen Gleichgewichts entspricht.",'Elektronen und L\xf6cher bewegen sich aufgrund ihrer Ladung und der Richtung des elektrischen Feldes zu den entsprechenden Polen der Spannungsquelle. In der B\xe4nderdiagrammdarstellung haben Elektronen stets das Bestreben, "nach unten" zu flie\xdfen, da dies einer Abnahme ihrer Energie entspricht; L\xf6cher streben entsprechend "nach oben". Bei geneigten Bandkanten stellt sich somit ein Ladungstr\xe4gertransport und damit ein Stromfluss I ein.',"Abh\xe4ngig von der Art und St\xe4rke der Dotierung (d.h. der Lage des Ferminiveaus relativ zu Wi) wird der Strom eher von Elektronen (n-Typ Halbleiter) oder von L\xf6chern (p-Typ Halbleiter) getragen."]),t.s)
B.J7=A.a(s(["Depending on the position of the Fermi level, it is a p-type or n-type semiconductor with a corresponding concentration of charge carrier densities (see representation of carrier densities depending on the position of the Fermi level)","At a voltage of U=0V, the Fermi level is at the same height everywhere, the semiconductor is in thermodynamic equilibrium and no current flows through the semiconductor","Applying an electrical voltage to the semiconductor causes a displacement of the band edges according to U=-W/q, so that the Fermi level within the semiconductor is no longer at the same energy level, which corresponds to a disturbance of the thermodynamic equilibrium",'Electrons and holes move to the corresponding poles of the voltage source due to their charge and the direction of the electric field. In the band diagram, electrons always strive to flow "downwards", as this corresponds to a decrease in their energy; holes strive "upwards" accordingly. In the case of inclined band edges, this results in a charge carrier transport and thus a current flow I.',"Depending on the type and strength of the doping (i.e. the position of the Fermi level relative to Wi), the current tends to be carried by electrons (n-type semiconductors) or by holes (p-type semiconductors)"]),t.s)
B.zj=new A.c_("Das folgende Applet zeigt den Vorgang des Ladungstr\xe4gertransportes in einem Halbleiter mit Hilfe der B\xe4nderdiagrammdarstellung, abh\xe4ngig von der angelegten Spannung und der Lage des Ferminiveaus.\n\nMan sieht:\n",B.IB,"The following applet shows the process of charge carrier transport in a semiconductor using the band diagram representation, depending on the applied voltage and the position of the Fermi level.\n\nYou can see:\n",B.J7,null)
B.J0=A.a(s(["Wird von au\xdfen eine elektrische Spannung Upn>0 an die Diode angelegt, so verringert sich die effektive, \xfcber dem pn-\xdcbergang liegende Spannung und damit auch das elektrische Feld E. Als Folge davon \xfcberwiegt nun die Diffusionsbewegung; Elektronen werden verst\xe4rkt ins p-Gebiet und L\xf6cher verst\xe4rkt in das n-Gebiet injiziert. Wegen der Neutralit\xe4t au\xdferhalb der RLZ m\xfcssen im gleichen Ma\xdfe die Majorit\xe4tstr\xe4gerdichten (L\xf6cher im p-Halbleiter, Elektronen im n-Halbleiter) ansteigen, so dass beide Ladungstr\xe4gerarten au\xdferhalb der RLZ oberhalb ihrer Gleichgewichtsdichten liegen. Dies f\xfchrt zur Rekombination der Ladungstr\xe4ger. So rekombinieren z.B. die in das p-Gebiet injizierten Elektronen mit den dort befindlichen L\xf6chern. Es m\xfcssen daher st\xe4ndig Majorit\xe4tstr\xe4ger aus den neutralen Gebieten nachgeliefert werden, was einem elektrischen Strom entspricht. Der Strom ist um so gr\xf6\xdfer, je mehr Ladungstr\xe4ger in die neutralen Gebiete injiziert werden, d.h. je h\xf6her die Konzentration der Ladungstr\xe4ger an den R\xe4ndern Xp und Xn der RLZ ist. Diese Konzentration h\xe4ngt exponentiell von der Spannung am pn-\xdcbergang und damit von der von au\xdfen angelegten Spannung Upn ab. Der Strom I durch die Diode steigt daher exponentiell mit der Spannung Upn, was sich in der steil ansteigenden I-U-Kennlinie f\xfcr U>0 zeigt.","F\xfcr Spannungen Upn < 0 wird die effektive Spannung und damit die Feldst\xe4rke E am pn-\xdcbergang erh\xf6ht. Dadurch \xfcberwiegt nun die Driftbewegung gegen\xfcber dem Diffusionsvorgang und die Ladungstr\xe4gerdichten an den Stellen Xn und Xp sinken auf sehr kleine Werte ab. Es gelangen somit auch nur noch sehr wenige Ladungstr\xe4ger durch die RLZ in das jeweils benachbarte Gebiet. Diese wenigen Ladungstr\xe4ger liefern den so genannten Sperrstrom, der sehr klein ist und der auch f\xfcr gro\xdfe negative Spannungen kaum noch w\xe4chst. Die I-U-Kennlinie zeigt daher f\xfcr negative Spannungen kaum noch eine \xc4nderung des Stromes I.","Da sich mit der von au\xdfen angelegten Spannung Upn auch die Spannung am pn-\xdcbergang - d.h. \xfcber der RLZ - \xe4ndert, ver\xe4ndert sich damit auch die Weite der gesamten Raumladungszone. Insbesondere w\xe4chst diese, wenn die Sperrspannung Upn < 0 weiter zu negativen Werten hin erh\xf6ht wird. Die Spannung \xfcber der RLZ - die der Fl\xe4che unter dem Dreieck E(X) entspricht - ist dabei gleich der Diffusionsspannung abz\xfcglich der Spannung Upn."]),t.s)
B.K8=A.a(s(["If an electric voltage Upn>0 is applied to the diode from the outside, the effective voltage across the pn junction is reduced, and with it the electric field E. As a result, the diffusion movement now predominates; electrons are increasingly injected into the p-region and holes increasingly into the n-region. Due to the neutrality outside the depletion layer, the majority carrier densities (holes in the p-semiconductor, electrons in the n-semiconductor) must increase to the same extent, so that both types of charge carrier outside the depletion layer are above their equilibrium densities. This leads to the recombination of the charge carriers. For example, the electrons injected into the p-region recombine with the holes located there. Majority carriers must therefore be constantly supplied from the neutral regions, which corresponds to an electric current. The current is greater the more charge carriers are injected into the neutral regions, i.e. the higher the concentration of charge carriers at the edges Xp and Xn of the depletion layer. This concentration depends exponentially on the voltage at the pn junction and thus on the externally applied voltage Upn. The current I through the diode therefore increases exponentially with the voltage Upn, which is reflected in the steeply rising I-V characteristic for U>0.","For voltages Upn < 0, the effective voltage and thus the field strength E at the pn junction is increased. As a result, the drift motion now outweighs the diffusion process and the charge carrier densities at points Xn and Xp drop to very low values. Thus, only very few charge carriers pass through the depletion layer into the neighboring area. These few charge carriers provide the so-called reverse current, which is very small and hardly increases even for large negative voltages. The I-V characteristic curve therefore shows hardly any change in the current I for negative voltages.","Since the voltage at the pn junction - i.e. across the RLZ - also changes with the externally applied voltage Upn, the width of the entire space charge zone also changes. In particular, this increases if the reverse voltage Upn < 0 is further increased towards negative values. The voltage across the depletion region - which corresponds to the area under the triangle E(X) - is equal to the diffusion voltage minus the voltage Upn."]),t.s)
B.zk=new A.c_("Dieses Applet veranschaulicht die Funktionsweise der Diode, indem eine Spannung Upn von au\xdfen an einen pn-\xdcbergang gelegt wird. Nach Vorgabe der Spannung Upn wird der Strom I durch die Diode berechnet. Dar\xfcber hinaus werden die Verteilungen der Ladungstr\xe4ger (Elektronen und L\xf6cher) im p- und n-Gebiet sowie das elektrische Feld E bestimmt und grafisch dargestellt.\n\nMan sieht:\n",B.J0,"This applet illustrates the functioning of a diode by applying a voltage Upn to a pn junction from the outside. After the voltage Upn has been specified, the current I through the diode is calculated. Furthermore, the distributions of the charge carriers (electrons and holes) in the p and n regions, as well as the electric field E, are determined and graphically displayed.\n        \nYou can see:\n",B.K8,null)
B.J3=A.a(s(["Liegt das Ferminiveau WF in der Mitte zwischen den beiden Bandkanten auf dem Intrinsicniveau Wi, so sind die Elektronendichte und die L\xf6cherdichte gleich der Intrinsicdichte ni.","Eine Verschiebung des Ferminiveaus zur Leitungsbandkante (was einem n-Typ Halbleiter entspricht) f\xfchrt zu einem Anstieg der Elektronendichte n0 und einer Abnahme der L\xf6cherdichte p0.","Bei einem p-Typ Halbleiter, bei dem das Ferminiveau zur Valenzbandkante verschoben ist, ist dagegen die L\xf6cherdichte erh\xf6ht und die Elektronendichte vermindert.","In allen F\xe4llen gilt, dass (im thermodynamischen Gleichgewicht) das Produkt aus Elektronendichte und L\xf6cherdichte gleich ni^2 ist (Massenwirkungsgesetz), was sich in der logarithmischen Darstellung deutlich zeigt."]),t.s)
B.Hj=A.a(s(["If the Fermi level WF lies in the middle between the two band edges at the intrinsic level Wi, the electron density and the hole density are equal to the intrinsic density ni","A shift of the Fermi level towards the conduction band edge (which corresponds to an n-type semiconductor) leads to an increase in the electron density n0 and a decrease in the hole density p0","In a p-type semiconductor, where the Fermi level is shifted to the valence band edge, the hole density is increased and the electron density is decreased","In all cases (in thermodynamic equilibrium) the product of electron density and hole density is equal to ni^2 (law of mass action), which is clearly shown in the logarithmic representation"]),t.s)
B.zl=new A.F4(null)
B.K5=A.a(s(["Dotiert man einen Silizium-Halbleiter mit Bor, d.h. ersetzt man in dem Kristallgitter einzelne (vierwertige) Si-Atome durch (dreiwertige) B-Atome, so gehen jeweils die drei Elektronen des Bor-Atoms (B) eine Bindung mit den benachbarten Si-Atomen ein.","Da bei dem Boratom ein Elektron zur Bindung fehlt, existiert an dieser Stelle eine L\xfccke, die zun\xe4chst noch an das Boratom gebunden ist. Es gen\xfcgt jedoch bereits eine sehr geringe Energiezufuhr (z.B. geringe Temperaturerh\xf6hung), damit sich ein vorher im Kristallgitter gebundenes Valenzelektron in diese L\xfccke setzt, d.h. an das Boratom (den so genannten Akzeptor) bindet. Dadurch entsteht an der Stelle, an der vorher das Valenzelektron sa\xdf, ein freies Loch, in das wiederum ein anderes Elektron springen kann. Die geringe Ionisierungsenergie des Boratoms entspricht im B\xe4nderdiagramm dem geringen Abstand des Energieniveaus des Akzeptors Wa zum Valenzband Wv.","Wegen der geringen Ionisierungsenergie sind bereits bei sehr geringen Temperaturen (hier: 100K) alle Boratome ionisiert, so dass im technisch relevanten Temperaturbereich davon ausgegangen werden kann, dass die Zahl der freien L\xf6cher po gleich der Dichte NA der Dotierungsatome ist.","Der negative Atomrumpf (B-) ist ortsfest und tr\xe4gt nicht zum Stromtransport im Halbleiter bei. Es erh\xf6ht sich demnach nur die Anzahl der freien L\xf6cher, die sich frei innerhalb des Halbleiters bewegen k\xf6nnen.","Der Halbleiter bleibt nach au\xdfen hin stets neutral, da jedem freien Ladungstr\xe4ger ein entgegengesetzt geladenes ortsfestes Ion gegen\xfcbersteht.","Da in dem mit Bor dotierten Halbleiter die freien L\xf6cher ma\xdfgeblich zum Ladungstransport beitragen, spricht man auch von einem p-Typ Halbleiter."]),t.s)
B.L_=A.a(s(["If a silicon semiconductor is doped with boron, i.e. if individual (tetravalent) Si atoms are replaced by (trivalent) B atoms in the crystal lattice, the three electrons of the boron atom (B) form a bond with the neighboring Si atoms","Since the boron atom is missing an electron for bonding, there is a gap at this point, which is initially still bound to the boron atom. However, even a very small amount of energy (e.g. a slight increase in temperature) is sufficient for a valence electron previously bound in the crystal lattice to move into this gap, i.e. to bind to the boron atom (the so-called acceptor). This creates a free hole in the place where the valence electron was previously located, into which another electron can jump. The low ionization energy of the boron atom corresponds to the small distance between the energy level of the acceptor Wa and the valence band Wv in the band diagram","Due to the low ionization energy, all boron atoms are already ionized at very low temperatures (here: 100K), so that in the technically relevant temperature range it can be assumed that the number of free holes po is equal to the density NA of the dopant atoms","The negative atomic body (B-) is stationary and does not contribute to current transport in the semiconductor. It therefore only increases the number of free holes, which can move freely within the semiconductor","The semiconductor always remains neutral towards the outside, as each free charge carrier is opposed by an oppositely charged stationary ion","Since the free holes in the boron-doped semiconductor contribute significantly to charge transport, it is also referred to as a p-type semiconductor"]),t.s)
B.zm=new A.c_("Dieses Applet zeigt, wie durch das Dotieren eines Silizium-Halbleiters mit geeigneten Fremdatomen (hier: Bor) die Anzahl der freien L\xf6cher erh\xf6ht werden kann. Dabei werden die Vorg\xe4nge sowohl im Halbleiterkristall (links) als auch im B\xe4nderdiagramm (rechts) dargestellt.\n\nMan sieht:\n",B.K5,"This applet shows how the number of free holes can be increased by doping a silicon semiconductor with suitable impurity atoms (here: boron). The processes are shown both in the semiconductor crystal (left) and in the ribbon diagram (right).\n\nYou can see:\n",B.L_,null)
B.KK=A.a(s(["Im Bode-Diagramm ist der typische Frequenzgang |a(jw)| und der Phasengang Phase[a(jw)] eines nicht r\xfcckgekoppelten Verst\xe4rkers a mit abnehmender Verst\xe4rkung f\xfcr hohe Frequenzen dargestellt, wie er sich z.B. f\xfcr einen Operationsverst\xe4rker ergibt.","Zus\xe4tzlich ist in das Diagramm der Kehrwert 1/k des - hier frequenzunabh\xe4ngigen - R\xfcckkopplungsfaktors eingetragen, was einem R\xfcckkopplungsnetzwerk mit ohmschen Widerst\xe4nden entspricht.","F\xfcr die Gesamtverst\xe4rkung des r\xfcckgekoppelten Systems gilt A = a/(1+ak). Da f\xfcr gro\xdfe Werte von a n\xe4herungsweise A=1/k gilt, kann man A direkt aus dem Diagramm ablesen. F\xfcr gr\xf6\xdfer werdendes k, d.h. st\xe4rkere R\xfcckkopplung, sieht man deutlich die Abnahme der Gesamtverst\xe4rkung.","Die f\xfcr die Stabilit\xe4t wichtige Schleifenverst\xe4rkung a*k ergibt sich in der logarithmischen Darstellung wegen a*k=a/(1/k) aus dem Abstand der Kurve a zur Kurve 1/k und kann ebenfalls direkt abgelesen werden.","Insbesondere ist am Schnittpunkt der Kurven a und 1/k der Betrag |a*k| der Schleifenverst\xe4rkung gleich 1 (=0dB). Ist nun bei dieser Frequenz wd die Phase gleichzeitig 180 Grad, so ist a*k = -1, d.h. der Verst\xe4rker ist instabil und schwingt.","F\xfcr kleine R\xfcckkopplungsfaktoren k ist bei der Frequenz wd die Phase sehr weit von dem kritischen Wert 180 Grad entfernt, der Verst\xe4rker ist stabil.","F\xfcr zunehmendes k, d.h. st\xe4rkere R\xfcckkopplung, r\xfcckt die Phase bei der Frequenz wd, wo der Betrag der Schleifenverst\xe4rkung gleich 1 ist, immer n\xe4her an 180 Grad, der Verst\xe4rker wird instabil und schwingt.","Um Stabilit\xe4t des r\xfcckgekoppelten Verst\xe4rkers f\xfcr beliebiges k zu gew\xe4hrleisten, greift man zur so genannten Kompensation. Dabei wird der Frequenz- und Phasengang des nicht r\xfcckgekoppelten Verst\xe4rkers durch schaltungstechnische Ma\xdfnahmen so ge\xe4ndert, dass die Phase an der Stelle wd f\xfcr beliebige k 180 Grad nicht erreicht."]),t.s)
B.HU=A.a(s(["The Bode diagram shows the typical frequency response |a(jw)| and phase response Phase[a(jw)] of an amplifier a with decreasing gain for high frequencies, as is the case for an operational amplifier, for example.","The reciprocal value 1/k of the feedback factor - which is frequency-independent here - is also entered in the diagram, which corresponds to a feedback network with resistors.","The total gain of the feedback system is given by A = a/(1+ak). Since A=1/k approximately applies for large values of a, A can be read directly from the diagram. For increasing k, i.e. stronger feedback, the decrease in total gain can be clearly seen.","The loop gain a*k, which is important for stability, can be read directly from the logarithmic diagram because a*k=a/(1/k) from the distance of the curve a to the curve 1/k.","In particular, at the intersection of the curves a and 1/k, the magnitude |a*k| of the loop gain is equal to 1 (=0dB). If the phase is 180 degrees at this frequency wd, then a*k = -1, i.e. the amplifier is unstable and oscillates.","For small feedback factors k, the phase at the frequency wd is very far from the critical value of 180 degrees; the amplifier is stable.","For increasing k, i.e. stronger feedback, the phase at the frequency wd, where the magnitude of the loop gain is equal to 1, moves closer and closer to 180 degrees, the amplifier becomes unstable and oscillates.","To ensure the stability of the feedback amplifier for any k, so-called compensation is used. In this case, the frequency and phase response of the non-feedback amplifier is changed by circuitry measures so that the phase at the point wd does not reach 180 degrees for any k."]),t.s)
B.zn=new A.c_("Dieses Applet zeigt den Zusammenhang zwischen der Schleifenverst\xe4rkung eines gegengekoppelten Verst\xe4rkers und dessen Stabilit\xe4t.\n\nMan sieht:\n",B.KK,"This applet shows the relationship between the loop gain of a negative feedback amplifier and its stability.\n\nYou can see:\n",B.HU,null)
B.Ik=A.a(s(["Vor dem Zusammenf\xfchren der beiden Halbleiter sind diese elektrisch neutral, da jedem freien Elektron (-) im n-Gebiet ein ortsfestes, positiv ionisiertes Donatoratom ND+ (nicht eingezeichnet) gegen\xfcbersteht. Umgekehrt wird die L\xf6cherladung im p-Typ Halbleiter von den ionisierten Akzeptoratomen NA- kompensiert.","Nach dem Zusammenf\xfchren entsteht wegen der gro\xdfen Konzentrationsgradienten an dem \xdcbergang zun\xe4chst eine Diffusionsbewegung der Ladungstr\xe4ger, d.h. L\xf6cher (+) diffundieren vom p-Gebiet in das n-Gebiet und Elektronen (-) vom n-Gebiet in das p-Gebiet. Dadurch entsteht jedoch ein Ladungsungleichgewicht und somit ein elektrisches Feld E, welches seinerseits eine Driftbewegung hervorruft, die der Diffusionsbewegung entgegengerichtet ist.","Nach kurzer Zeit stellt sich ein Gleichgewicht zwischen dem Diffusionsvorgang und der Driftbewegung ein."]),t.s)
B.KG=A.a(s(["Before the two semiconductors are brought together, they are electrically neutral, since each free electron (-) in the n-type region is opposed by a fixed, positively ionized donor atom ND+ (not shown). Conversely, the hole charge in the p-type semiconductor is compensated by the ionized acceptor atoms NA-.After the two semiconductors are brought together, the large concentration gradients at the interface initially cause a diffusion movement of the charge carriers, i.e. holes (+) diffuse from the p-type region into the n-type region and electrons (-) from the n-type region into the p-type region. However, this creates a charge imbalance and thus an electric field E, which in turn causes a drift movement in the opposite direction to the diffusion movement.","After a short time, equilibrium is established between the diffusion process and the drift movement."]),t.s)
B.zo=new A.F5(null)
B.KE=A.a(s(["F\xfcr eine gegebene Spannung UBE liefert der Schnittpunkt der jeweiligen Transistorausgangskennlinie mit der Lastgeraden den Wert des Stromes IC sowie der Ausgangsspannung UCE.","Soll eine sinusf\xf6rmige Basis-Emitter-Spannung (AC on) verst\xe4rkt werden, so ergibt sich die beste Verst\xe4rkerwirkung, wenn das Signal um eine Spannung UBE0 herum ge\xe4ndert wird, die in etwa in der Mitte des aussteuerbaren Bereiches, d.h. UBE0=0.72V, liegt.","Bei gr\xf6\xdferen oder kleineren Werten von UBE0 arbeitet der Transistor entweder im S\xe4ttigungs- oder im Sperrbetrieb, so dass die Verst\xe4rkung deutlich abnimmt."]),t.s)
B.HP=A.a(s(["For a given voltage UBE, the intersection of the respective transistor output characteristic with the load line provides the value of the current IC and the output voltage UCE.","If a sinusoidal base-emitter voltage (AC on) is to be amplified, the best amplification effect is achieved if the signal is changed around a voltage UBE0 that is approximately in the center of the controllable range, i.e. UBE0=0.72V.","At larger or smaller values of UBE0, the transistor either operates in saturation or in cutoff mode, so that the gain decreases significantly."]),t.s)
B.zp=new A.c_(u.f,B.KE,u.G,B.HP,null)
B.KQ=A.a(s(["Bei der Spannung UGB=0V liegen die Ferminiveaus des Metalls und des Halbleiters auf gleicher H\xf6he. Die B\xe4nder verlaufen horizontal.","Bei negativen Spannungen (UGB<0V) verschieben sich die Ferminiveaus gem\xe4\xdf U=-W/q und es tritt eine Verbiegung der B\xe4nder sowohl im Isolator als auch im Halbleiter auf. Der gr\xf6\xdfer werdende Abstand zwischen Ferminiveau Wf und Intrinsicniveau Wi entspricht einer Zunahme der L\xf6cherdichte und einer Abnahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter (vgl. Darstellung der Tr\xe4gerdichten abh\xe4ngig von der Lage des Ferminiveaus). Diesen Fall der Anh\xe4ufung von Majorit\xe4tstr\xe4gern an der Grenzfl\xe4che Oxid-Halbleiter nennt man Akkumulation.","Bei kleinen positiven Spannungen (UGB>0V) verbiegen sich die B\xe4nder entsprechend in die andere Richtung, so dass nun eine Abnahme der L\xf6cherdichte und eine Zunahme der Elektronendichte in der N\xe4he der Grenzfl\xe4che Oxid-Halbleiter auftritt. Durch das Ausr\xe4umen der L\xf6cher entsteht eine Raumladungszone in dem Bereich 0<x<xd. Diesen Fall nennt man Verarmung.","Ab einer bestimmten positiven Spannung (hier: UGB=0,8V) ist die Elektronendichte an der Grenzfl\xe4che so gro\xdf wie die L\xf6cherdichte des p-Halbleiters sehr weit von der Grenzfl\xe4che entfernt. Diesen Zustand des Halbleiters nennt man Inversion. Die Spannung, bei der die Inversion einsetzt, ist die so genannte Einsatzspannung.","F\xfcr noch gr\xf6\xdfere Spannungen oberhalb der Einsatzspannung (hier: UGB>0,8V) nimmt die Elektronendichte an der Grenzschicht Oxid-Halbleiter immer weiter zu, die B\xe4nder des Halbleiters verbiegen sich wegen der exponentiellen Abh\xe4ngigkeit zwischen Spannung und Ladungstr\xe4gerdichte aber kaum noch. Das hei\xdft, dass auch die Weite xd der Raumladungszone von nun ab n\xe4herungsweise konstant bleibt."]),t.s)
B.JU=A.a(s(["At a voltage UGB=0V, the Fermi levels of the metal and the semiconductor are at the same level. The bands run horizontally.","At negative voltages (UGB<0V), the Fermi levels shift according to U=-W/q and the bands in both the insulator and the semiconductor are bent. The increasing distance between the Fermi level Wf and the intrinsic level Wi corresponds to an increase in the hole density and a decrease in the electron density in the vicinity of the oxide-semiconductor interface (cf. illustration of the carrier densities depending on the position of the Fermi level). This case of the accumulation of majority carriers at the oxide-semiconductor interface is called accumulation.","At small positive voltages (VGS>0V), the bands bend in the other direction, so that there is now a decrease in hole density and an increase in electron density near the oxide-semiconductor interface. The removal of holes creates a space charge zone in the range 0<x<xd. This case is called depletion.","From a certain positive voltage (here: UGB=0.8V) onwards, the electron density at the interface is as high as the hole density of the p-semiconductor very far from the interface. This state of the semiconductor is called inversion. The voltage at which inversion occurs is known as the inversion voltage.","For even higher voltages above the threshold voltage (here: UGB>0.8V), the electron density at the oxide-semiconductor interface continues to increase, but the bands of the semiconductor hardly bend at all due to the exponential dependence between voltage and charge carrier density. This means that the width xd of the space charge region also remains approximately constant from now on."]),t.s)
B.zq=new A.c_("Dieses Applet verdeutlicht die physikalischen Vorg\xe4nge in der MOS-Struktur nochmals anhand einer vereinfachten B\xe4nderdiagrammdarstellung. Gezeigt wird das Verhalten einer MOS-Struktur abh\xe4ngig von der angelegten Spannung.\n\nMan sieht:\n",B.KQ,"This applet illustrates the physical processes in the MOS structure again using a simplified band diagram representation. The behavior of a MOS structure depending on the applied voltage is shown.\n\nYou can see:",B.JU,null)
B.KV=A.a(s(["Durch die unterschiedlichen Lagen der Bandkanten Wv und Wc relativ zum Ferminiveau bei unterschiedlichen Dotierungen (vgl.: Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm), stellt das Bulk-Gebiet (p-dotiert) eine Potenzialbarriere dar, die Elektronen \xfcberwinden m\xfcssen, wenn sie sich von der n-dotierten Source zu der n-dotierten Drain bewegen.","Erh\xf6ht man bei UGS=0 das Potenzial an der Drain-Elektrode (UDS>0), verschieben sich dort das Ferminiveau und demzufolge auch die Bandkanten Wc und Wv entsprechend nach unten, die Elektronen k\xf6nnen aber die nach wie vor existierende Potentialbarriere zwischen Source und Drain nicht \xfcberwinden, so dass kein Strom flie\xdft.","Erh\xf6ht man das Potenzial an der Gate-Elektrode, bleibt das Ferminiveau im Bulk zwar auf unver\xe4ndertem Niveau, die Bandkanten Wc und Wv verschieben sich jedoch im Bereich des Gates relativ zum Ferminiveau nach unten (siehe auch: B\xe4nderdiagramm einer MOS-Struktur) und die Potenzialbarriere zwischen Source und Drain verringert sich. Bei hinreichend gro\xdfer Gatespannung (UGS>Uth) kann demnach ein Strom zwischen Source und Drain flie\xdfen, sofern eine Spannung UDS anliegt.","Ein Erh\xf6hen des Bulk-Potenzials (USB<0) verschiebt hingegen das Ferminiveau im Bereich des Bulks nach oben und damit auch die Potenzialbarriere. Unter sonst gleichen Bedingungen muss also jetzt eine h\xf6here Gatespannung UGS angelegt werden, um einen Stromfluss zwischen Source und Drain zu erhalten. Diesen Effekt bezeichnet man auch als Substratsteuereffekt."]),t.s)
B.KR=A.a(s(["Due to the different positions of the band edges Wv and Wc relative to the Fermi level at different doping levels (cf. illustration of charge carrier transport in the band diagram), the bulk region (p-doped) represents a potential barrier that electrons must overcome when they move from the n-doped source to the n-doped drain.","If the potential at the drain electrode is increased at UGS=0 (UDS>0), the Fermi level and, consequently, the band edges Wc and Wv also shift downwards accordingly, but the electrons are still unable to overcome the potential barrier between source and drain, so that no current flows.","If the potential at the gate electrode is increased, the Fermi level in the bulk remains at the same level, but the band edges Wc and Wv shift downwards relative to the Fermi level in the area of the gate (see also: band diagram of a MOS structure) and the potential barrier between source and drain is reduced. If the gate voltage is sufficiently high (UGS>Uth), a current can flow between the source and drain if a voltage UDS is applied.","Increasing the bulk potential (USB<0), on the other hand, shifts the Fermi level in the bulk region upwards and thus also the potential barrier. All other things being equal, a higher gate voltage UGS must now be applied to obtain a current flow between source and drain. This effect is also known as the substrate control effect."]),t.s)
B.zr=new A.c_("Das folgende Applet stellt die Funktionsweise des MOSFET mit Hilfe des B\xe4nderdiagramms dar. Gate-, Drain- und Bulk-Potenzial k\xf6nnen dabei jeweils gegen\xfcber dem Source-Potenzial (Bezugspotenzial) ge\xe4ndert werden.\n\nMan sieht:\n",B.KV,"The following applet shows how the MOSFET works using a band diagram. The gate, drain and bulk potentials can be changed relative to the source potential (reference potential).\n\nYou can see:\n",B.KR,null)
B.Ie=A.a(s(["Durch Bestrahlung werden Ladungstr\xe4gerpaare im Innern der Fotodiode generiert. Eine Erh\xf6hung der Bestrahlungsst\xe4rke Ee f\xfchrt zu einem Anstieg der Generationsrate und somit zu einer h\xf6heren Anzahl freier Ladungstr\xe4ger. Umgekehrt f\xfchrt eine Verringerung der Bestrahlungsst\xe4rke zu einer Verringerung der Generationsrate.","Die durch die Bestrahlung generierten Ladungstr\xe4ger werden durch das eingebaute elektrische Feld E der Raumladungszone sofort getrennt und zu den neutralen Bahngebieten hin abtransportiert, ohne dass dazu eine externe Spannung notwendig ist. Der Fotostrom steht daher direkt an den Elektroden der Fotodiode zur Verf\xfcgung. Der Fotostrom ist proportional zu der Bestrahlungsst\xe4rke Ee und in erster N\xe4herung unabh\xe4ngig von der angelegten Spannung U (der Grund hierf\xfcr ist, dass das eingebaute elektrische Feld E der Raumladungszone bereits gro\xdf genug ist, um die Ladungstr\xe4ger auf ihre S\xe4ttigungsgeschwindigkeit zu beschleunigen. Eine weitere Erh\xf6hung des elektrischen Feldes durch \xc4nderung der Spannung U f\xfchrt dann zu keiner weiteren Erh\xf6hung der Geschwindigkeit der Ladungstr\xe4ger - und damit zu keinem Anstieg des Stromes)."]),t.s)
B.IH=A.a(s(["Irradiation generates charge carrier pairs inside the photodiode. An increase in the irradiation intensity Ee leads to an increase in the generation rate and thus to a higher number of free charge carriers. Conversely, a decrease in the irradiation intensity leads to a decrease in the generation rate.","The charge carriers generated by the irradiation are immediately separated by the built-in electric field E of the space charge region and transported to the neutral drift regions without the need for an external voltage. The photocurrent is therefore available directly at the electrodes of the photodiode. The photocurrent is proportional to the irradiance Ee and, in the first approximation, independent of the applied voltage U (the reason for this is that the built-in electric field E of the space charge region is already large enough to accelerate the charge carriers to their saturation speed. A further increase in the electric field by changing the voltage U then does not lead to a further increase in the speed of the charge carriers - and thus to an increase in the current)."]),t.s)
B.zs=new A.c_("Dieses Applet veranschaulicht die Funktion einer Fotodiode. Die in der linken Bildh\xe4lfte des Applets schematisch dargestellte Fotodiode besitzt eine pin-Struktur, d.h. zwischen dem p- und dem n-Gebiet liegt ein undotiertes (intrinsisches) i-Gebiet (grau dargestellt). Das p- und das n-Gebiet bewirken eine \xfcber das gesamte i-Gebiet ausgedehnte Raumladungszone mit einer hohen elektrischen Feldst\xe4rke E. Aus Gr\xfcnden der \xdcbersichtlichkeit werden nur die durch Bestrahlung generierten freien Ladungstr\xe4ger animiert. Die rechte Bildh\xe4lfte des Applets zeigt die Strom-Spannungs Kennlinie des Bauelementes, wobei der aktuelle Arbeitspunkt durch einen roten Punkt gekennzeichnet ist. Hellgrau schattiert ist der dritte Quadrant der Kennlinie (U<0 und I<0); in diesem Quadranten arbeitet die Fotodiode im Diodenbetrieb. Mit Hilfe der vier Schaltfl\xe4chen im unteren Bereich des Applets k\xf6nnen die Bestrahlungsst\xe4rke Ee sowie die angelegte Spannung U variiert werden.\n\nMan sieht:\n",B.Ie,"This applet illustrates the function of a photodiode. The photodiode shown schematically on the left-hand side of the applet has a pin structure, i.e. an undoped (intrinsic) i region (shown in gray) lies between the p and n regions. The p- and n-regions cause a space charge zone with a high electric field strength E to extend over the entire i-region. For reasons of clarity, only the free charge carriers generated by irradiation are animated. The right half of the applet shows the current-voltage characteristic of the component, with the current operating point marked by a red dot. The third quadrant of the characteristic curve (U<0 and I<0) is shaded light gray; in this quadrant the photodiode operates in diode mode. The four buttons at the bottom of the applet can be used to vary the irradiance Ee and the applied voltage U.\n\nYou can see:\n",B.IH,null)
B.Ks=A.a(s(["Je nach Typ (n oder p) sind freie Elektronen oder L\xf6cher in einem Halbleiter vorhanden.","Legt man eine Spannung U an die Struktur, so bewirkt dies ein elektrisches Feld E im Halbleiter.","Unter Einfluss des elektrisches Feldes E bewegen sich die freien Ladungstr\xe4ger in dem Halbleiter, was zu einem elektrischen Strom I f\xfchrt.","Je gr\xf6\xdfer die Spannung ist, desto so gr\xf6\xdfer ist das elektrische Feld und damit die Geschwindigkeit der Ladungstr\xe4ger, was eine Zunahme des Stromes bedeutet. Der Zusammenhang zwischen elektrischem Feld und der Ladungstr\xe4gergeschwindigkeit ist die so genannte Beweglichkeit."]),t.s)
B.Ji=A.a(s(["Depending on the type (n or p), free electrons or holes are present in a semiconductor","If a voltage U is applied to the structure, this causes an electric field E in the semiconductor","Under the influence of the electric field E, the free charge carriers move in the semiconductor, which leads to an electric current I.","The greater the voltage, the greater the electric field and thus the speed of the charge carriers, which means an increase in current. The relationship between the electric field and the speed of the charge carriers is known as mobility"]),t.s)
B.zt=new A.c_("Dieses Applet verdeutlicht den Einfluss eines elektrischen Feldes auf freie Ladungstr\xe4ger in einem Halbleiter.\n\nMan sieht:\n",B.Ks,"This applet illustrates the influence of an electric field on free charge carriers in a semiconductor.\n\nYou can see:\n",B.Ji,null)
B.GZ=A.a(s(["Bei einem einzigen Atom (n=1) erh\xe4lt man zwei m\xf6gliche Energiezust\xe4nde, von denen der untere besetzt ist.","Bei zwei Atomen (n=2) spalten sich die Energiezust\xe4nde wegen der Kopplung zwischen den beiden Atomen auf.","Erh\xf6ht man die Anzahl der Atome weiter, so spalten sich die Energieniveaus immer weiter auf, bis diese bei einer sehr gro\xdfen Anzahl von Atomen (hier n=16) so dicht beieinander liegen, dass man nicht mehr von Energielinien sondern von Energieb\xe4ndern spricht.","Da in diesem Beispiel eine sehr niedrige Umgebungstemperatur angenommen wurde, befinden sich alle Elektronen in dem jeweils niedrigsten Energiezustand, d.h. in dem unteren Energieband. Das obere Energieband ist unter diesen Bedingungen vollst\xe4ndig unbesetzt."]),t.s)
B.K_=A.a(s(["For a single atom (n=1), there are two possible energy states, the lower of which is occupied.","With two atoms (n=2), the energy states split due to the coupling between the two atoms.","If the number of atoms is increased further, the energy levels split further and further until, with a very large number of atoms (here n=16), they are so close together that they are no longer referred to as energy lines but as energy bands.","As a very low ambient temperature was assumed in this example, all electrons are in the lowest energy state, i.e. in the lower energy band. The upper energy band is completely unoccupied under these conditions."]),t.s)
B.zu=new A.c_("Dieses Applet illustriert den \xdcbergang von einem einzelnen Atom zu einem Kristall mit einer sehr gro\xdfen Zahl von regelm\xe4\xdfig angeordneten Atomen, wobei der Abstand der Atome untereinander so gering ist, dass die Atome miteinander in Wechselwirkung stehen. Die Umgebungstemperatur sei in dem Beispiel sehr niedrig, so dass jeweils die untersten Energiezust\xe4nde besetzt sind.\n\nMan sieht:\n",B.GZ,"This applet illustrates the transition from a single atom to a crystal with a very large number of regularly arranged atoms, whereby the distance between the atoms is so small that the atoms interact with each other.The ambient temperature in the example is very low, so that the lowest energy states are occupied.\n\nYou can see:\n",B.K_,null)
B.Ki=A.a(s(["F\xfcr T=0 nehmen die Elektronen ihren jeweils niedrigstm\xf6glichen Energiezustand an. Da nach dem Pauli-Prinzip ein Zustand jedoch nur mit maximal zwei Elektronen besetzt werden kann, sind auch von Null verschiedene Zust\xe4nde mit Elektronen besetzt. Die Energie, bis zu der bei T=0 alle Zust\xe4nde besetzt sind, bezeichnet man als das Ferminiveau Wf.","Die Besetzungswahrscheinlichkeit F(W) ist bei T=0 daher F(W)=1 f\xfcr alle Energieniveaus unterhalb des Ferminiveaus und F(W)=0 f\xfcr alle Energieniveaus oberhalb des Ferminiveaus.","Eine Erh\xf6hung der Temperatur T f\xfchrt zu einer Zunahme der Gesamtenergie in dem System. Dies \xe4u\xdfert sich darin, dass einzelne Elektronen auch h\xf6here Energiezust\xe4nde annehmen k\xf6nnen. Die Besetzungswahrscheinlichkeit F(W) h\xf6herer Zust\xe4nde nimmt daher zu und die niedriger Zust\xe4nde entsprechend ab.","Je h\xf6her die Temperatur ist, um so h\xf6her ist die Gesamtenergie des Systems. Die Wahrscheinlichkeit, dass ein energetisch hochliegender Zustand besetzt ist, steigt demnach mit zunehmender Temperatur immer weiter an. Gleichzeitig nimmt die Wahrscheinlichkeit, dass energetisch tiefliegende Zust\xe4nde besetzt sind, ab."]),t.s)
B.KP=A.a(s(["For T=0, the electrons assume their lowest possible energy state. However, since according to the Pauli principle a state can only be occupied by a maximum of two electrons, states other than zero are also occupied by electrons. The energy up to which all states are occupied at T=0 is referred to as the Fermi level Wf","The occupation probability F(W) at T=0 is therefore F(W)=1 for all energy levels below the Fermi level and F(W)=0 for all energy levels above the Fermi level","An increase in temperature T leads to an increase in the total energy in the system. This is expressed by the fact that individual electrons can also assume higher energy states. The occupation probability F(W) of higher states therefore increases and that of lower states decreases accordingly","The higher the temperature, the higher the total energy of the system. The probability that an energetically high state is occupied therefore increases with increasing temperature. At the same time, the probability that energetically low-lying states are occupied decreases"]),t.s)
B.zv=new A.c_("Dieses Applet veranschaulicht die Bedeutung der Fermiverteilung F(W) und des Ferminiveaus anhand eines Systems mit diskreten Energiezust\xe4nden.\n\nMan sieht:\n",B.Ki,"This applet illustrates the meaning of the Fermi distribution F(W) and the Fermi level using a system with discrete energy states.\n\nYou can see:\n",B.KP,null)
B.KI=A.a(s(["Da im thermodynamischen Gleichgewicht die Fermienergie Wf (hier nicht dargestellt) im Bauelement \xfcberall auf dem gleichen Niveau liegt, ist die relative Lage der Valenz- und Leitungsbandkanten in den einzelnen Gebieten von den dortigen Dotierungen abh\xe4ngig (vgl. Darstellung des Ladungstr\xe4gertransportes im B\xe4nderdiagramm). In den n-dotierten Source- und Draingebieten liegen die Bandkanten Wc und Wv demnach unterhalb denen im p-dotierten Bulk und es ergeben sich die im Diagramm dargestellten Potenzialverl\xe4ufe.","Damit Elektronen von der Source zur Drain wandern k\xf6nnen, m\xfcssen diese erst die unterhalb des Gates liegende Potenzialbarriere \xfcberwinden. Die H\xf6he der Barriere h\xe4ngt dabei insbesondere von den am Transistor anliegenden Spannungen ab:",'Durch Anlegen einer positiven Gatespannung (UGS>0) gegen\xfcber dem Bezugspotenzial (Source) verschiebt sich das Ferminiveau an der Gate-Elektrode nach unten und die Bandkanten Wc und Wv im Bulk unmittelbar unterhalb des Gate "verbiegen" sich (vgl.: B\xe4nderdiagramm einer MOS-Struktur). Dadurch verringert sich die Potenzialbarriere.',"Durch Anlegen einer negativen Bulkspannung (USB>0) gegen\xfcber dem Bezugspotenzial (Source) verschieben sich das dortige Ferminiveau und damit die Bandkanten Wc und Wv im Bereich des Bulk nach oben und die Potentialbarriere erh\xf6ht sich.","Ob ein Strom durch den Transistor flie\xdfen kann oder nicht, h\xe4ngt somit von der Lage der Bandkanten unmittelbar unterhalb des Gates (im Bereich des Kanals) ab. In den nachfolgenden Applets ist daher lediglich der Verlauf der Bandkanten entlang der y-Achse bei x=0 dargestellt."]),t.s)
B.Kr=A.a(s(["Since the Fermi energy Wf (not shown here) is at the same level everywhere in the component in thermodynamic equilibrium, the relative position of the valence and conduction band edges in the individual regions depends on the doping there (cf. illustration of charge carrier transport in the band diagram). In the n-doped source and drain regions, the band edges Wc and Wv are therefore below those in the p-doped bulk, and the potential curves shown in the diagram result.","For electrons to be able to migrate from the source to the drain, they first have to overcome the potential barrier below the gate. The height of the barrier depends in particular on the voltages applied to the transistor:",'When a positive gate voltage (UGS>0) is applied with respect to the reference potential (source), the Fermi level at the gate electrode is shifted downwards and the band edges Wc and Wv in the bulk directly below the gate are "bent" (cf. band diagram of a MOS structure). This reduces the potential barrier.',"By applying a negative bulk voltage (USB>0) with respect to the reference potential (source), the Fermi level there and thus the band edges Wc and Wv in the bulk area move upwards and the potential barrier increases.","Whether or not a current can flow through the transistor depends on the position of the band edges directly below the gate (in the channel area). The following applets therefore only show the course of the band edges along the y-axis at x=0."]),t.s)
B.zw=new A.c_("Das Applet zeigt den Verlauf des B\xe4nderdiagramms eines MOSFET \xfcber dem Querschnitt des Bauelementes. Es wird der Einfluss von Gate- und Substratspannung auf den Verlauf der Bandkanten Wc und Wv schematisch dargestellt. In dem Applet liegt der Source-Anschluss auf 0V (Bezugspotenzial).\n\nMan sieht:\n",B.KI,"The applet shows the progression of the band diagram of a MOSFET across the cross-section of the component. The influence of the gate and substrate voltage on the progression of the band edges Wc and Wv is schematically represented. In the applet, the source connection is at 0V (reference potential).\n\nYou can see:",B.Kr,null)
B.GU=A.a(s(["Liegt ein Elektron energiem\xe4\xdfig oberhalb der Bandkante Wc, so besitzt es zus\xe4tzliche kinetische Energie und damit einen Impuls i. Die Impulsvektoren aller Teilchen mit einer Energie zwischen W und W+dW haben demnach einen Impuls zwischen i und i+di, so dass die Impulsvektoren auf einer Kugelschale mit dem Radius i und der Dicke di liegen.","Die Zahl der voneinander unterscheidbaren Impulsvektoren auf der Kugelschale ist jedoch begrenzt, da der Impuls nach der Heisenbergschen Unsch\xe4rferelation eine gewisse Unsch\xe4rfe hat, wenn der Ort des Teilchens genau bestimmt ist. Die Impulsvektoren m\xfcssen also einen bestimmten Mindestabstand voneinander haben.","Erh\xf6ht man nun die Energie W und damit den Impuls i, entspricht das einer Vergr\xf6\xdferung der Kugelschale, so dass nun mehr Impulsvektoren Platz finden; die Zustandsdichte nimmt zu."]),t.s)
B.HH=A.a(s(["If an electron is above the band edge Wc in terms of energy, it has additional kinetic energy and thus a momentum i. The momentum vectors of all particles with an energy between W and W+dW therefore have a momentum between i and i+di, so that the momentum vectors lie on a spherical shell with radius i and thickness di","However, the number of momentum vectors on the spherical shell that can be distinguished from each other is limited, as the momentum has a certain uncertainty according to Heisenberg's uncertainty principle if the location of the particle is precisely determined. The momentum vectors must therefore have a certain minimum distance from each other","If you now increase the energy W and thus the momentum i, this corresponds to an enlargement of the spherical shell, so that there is now room for more momentum vectors; the density of states increases"]),t.s)
B.zx=new A.c_("Dieses Applet veranschaulicht den Begriff der Zustandsdichte.\n\nMan sieht:\n",B.GU,"The applet illustrates the concept of density of states.\n\nYou can see:\n",B.HH,null)
B.IF=A.a(s(["Bei ausgeschaltetem Licht befinden sich in der Halbleiterprobe keine zus\xe4tzlichen Elektron-Loch Paare; die Tr\xe4gerdichten n, p entsprechen den Gleichgewichtsdichten n0, p0.","Nach dem Einschalten des Lichts erh\xf6ht sich durch die zugef\xfchrte Energie die Generationsrate, d.h. es werden zus\xe4tzliche Elektron-Loch Paare gebildet: Die Tr\xe4gerdichten n und p steigen um den jeweils gleichen Betrag an.","Da mit zunehmender Ladungstr\xe4gerdichte n, p auch die Rekombinationsrate R steigt (R ~ n*p), stellt sich nach einiger Zeit ein neuer Gleichgewichtszustand ein, in dem genauso viel Ladungstr\xe4gerpaare generiert werden wie durch Rekombination verschwinden.","Wird das Licht wieder ausgeschaltet, werden keine zus\xe4tzlichen Ladungstr\xe4ger mehr generiert und nach einiger Zeit wird der urspr\xfcngliche Gleichgewichtszustand (TGG) wieder erreicht.","Die Zeitkonstante, mit der der Ausgleichsvorgang erfolgt, ist die Lebensdauer der Minorit\xe4tstr\xe4ger."]),t.s)
B.KA=A.a(s(["When the light is switched off, there are no additional electron-hole pairs in the semiconductor sample; the carrier densities n, p correspond to the equilibrium densities n0, p0","After the light is switched on, the generation rate increases due to the energy supplied, i.e. additional electron-hole pairs are formed: The carrier densities n and p increase by the same amount in each case.","Since the recombination rate R also increases with increasing carrier density n, p (R ~ n*p), a new equilibrium state is established after some time, in which as many carrier pairs are generated as disappear through recombination","If the light is switched off again, no more additional charge carriers are generated and after some time the original equilibrium state (TGG) is reached again","The time constant with which the equalization process takes place is the lifetime of the minority carriers"]),t.s)
B.zy=new A.c_("In einem Halbleiter werden bei Temperaturen T>0 st\xe4ndig Elektron-Loch Paare durch thermische Generation erzeugt; gleichzeitig rekombiniert die gleiche Anzahl von Elektron-Loch Paaren, so dass sich ein - temperaturabh\xe4ngiges - Gleichgewicht, das so genannte thermodynamische Gleichgewicht (TGG) einstellt. Durch Injektion zus\xe4tzlicher Ladungstr\xe4ger oder Lichteinstrahlung kann dieses Gleichgewicht jedoch gest\xf6rt werden.\n\nDieses Applet zeigt das Verhalten einer Halbleiterprobe bei einer St\xf6rung des TGGs durch Lichteinstrahlung und den anschlie\xdfenden Ausgleichsvorgang. Der Anschaulichkeit halber werden in dem Halbleiter nur die durch die Lichteinstrahlung zus\xe4tzlich generierten Ladungstr\xe4ger dargestellt.\n\nMan sieht:\n",B.IF,"In a semiconductor, electron-hole pairs are constantly generated by thermal generation at temperatures T>0; at the same time, the same number of electron-hole pairs recombine, so that a - temperature-dependent - equilibrium, the so-called thermodynamic equilibrium (TGG), is established. However, this equilibrium can be disturbed by injecting additional charge carriers or light irradiation.\n\nThis applet shows the behavior of a semiconductor sample when the TGG is disturbed by light irradiation and the subsequent equilibration process. For the sake of clarity, only the additional charge carriers generated by the light irradiation are shown in the semiconductor.\n\nYou can see:\n",B.KA,null)
