B.KO=A.a(s(["Trifft ein Photon mit der Energie Wph > Wg auf den Halbleiter, so wird ein Elektron-Loch-Paar generiert."]),t.s)
B.Hk=A.a(s(["If a photon with an energy of Wph > Wg hits the semiconductor, an electron-hole pair is generated."]),t.s)
B.yF=new A.c_('Das folgende Applet zeigt das B\xe4nderdiagramm (links) sowie das Energie-Impuls Diagramm (rechts) eines direkten bzw. eines indirekten Halbleiters. Der darzustellende Halbleitertyp kann mit Hilfe des Auswahlfeldes "Semiconductor type" ausgew\xe4hlt werden. Bet\xe4tigt man anschlie\xdfend die "Start Generation"-Schaltfl\xe4che, so wird das Auftreffen eines Photons auf den Halbleiter und die damit verbundene Generation eines Elektron-Loch-Paares animiert. Auf die gleiche Weise kann anschlie\xdfend die Animation der Thermalisierung und der Rekombination gestartet werden.\n\nMan sieht:\n',B.KO,'The following applet shows the band diagram (left) and the energy-momentum diagram (right) of a direct and an indirect semiconductor, respectively. The type of semiconductor to be displayed can be selected using the "Semiconductor type" selection box. If you then click on the "Start Generation" button, the impact of a photon on the semiconductor and the associated generation of an electron-hole pair is animated. The animation of the thermalization and recombination can then be started in the same way.\n\nYou can see:\n',B.Hk,null)
B.W=new A.nx(0,"start")
B.bI=new A.dV(14,null,null,null)
B.Q=new A.D(!0,null,null,null,null,null,18,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
B.c5=new A.ao("\u2022 ",null,B.Q,null,null,null,null,null,null)
B.aN=new A.a0e(0,"tight")
B.HL=A.a(s(["Beim direkten Halbleiter zeigt das Energie-Impuls Diagramm nach dem Generationsvorgang, dass sowohl die Energiebilanz auch die Impulsbilanz erf\xfcllt ist: Zum einen entspricht der energetische Abstand der Teilchen der Energie Wph des eingestrahlten Photons, zum anderen weisen Elektron und Loch identische Impulse i auf, da die Teilchen im Energie-Impuls Diagramm direkt \xfcbereinander liegen.","Nach der Generation k\xf6nnen sich die Ladungstr\xe4ger frei im Halbleiter bewegen, wobei sie ihre kinetische Energie durch St\xf6\xdfe an das Kristallgitter abgeben. Dies \xe4u\xdfert sich darin, dass sich Elektron und Loch jeweils in Richtung der Bandkanten, also zu niedrigeren Energiewerten hin bewegen (Thermalisierung).","Treffen nun ein Elektron und ein Loch aufeinander, so k\xf6nnen sie unter Aussendung eines Photons rekombinieren. Die Energie Wem eines unter diesen Bedingungen emittierten Photons entspricht etwa dem Wert des Bandabstandes Wg des Halbleiters."]),t.s)
B.IY=A.a(s(["In the direct semiconductor, the energy-momentum diagram after the generation process shows that both the energy balance and the momentum balance are fulfilled: on the one hand, the energetic distance of the particles corresponds to the energy Wph of the incident photon, on the other hand, the electron and hole have identical momentums i, since the particles in the energy-momentum diagram are directly superimposed.","After generation, the charge carriers can move freely in the semiconductor, whereby they transfer their kinetic energy to the crystal lattice through collisions. This is expressed by the fact that the electron and hole each move in the direction of the band edges, i.e. towards lower energy values (thermalization).","If an electron and a hole meet, they can recombine by emitting a photon. The energy of a photon emitted under these conditions is approximately equal to the band gap Wg of the semiconductor."]),t.s)
B.yI=new A.c_("Direkter Halbleiter:",B.HL,"Direct semiconductor:",B.IY,null)
B.EG=new A.es(1,B.aN,B.yI,null)
B.K0=A.a(s([B.bI,B.c5,B.EG]),t.p)
B.PO=new A.eW(B.at,B.k,B.i,B.W,null,B.ak,null,B.K0,null)
B.I7=A.a(s(["Wie beim direkten Halbleiter erfolgt unmittelbar nach der Generation die Thermalisierung, bei der die Ladungstr\xe4ger Energie und Impuls an das Kristallgitter abgeben.","Die Energieminima von Elektronen und L\xf6chern liegen jedoch bei indirekten Halbleitern bei unterschiedlichen Impulswerten. Eine direkte Rekombination der thermalisierten Ladungstr\xe4ger ist daher nicht ohne Weiteres m\xf6glich, da die Impulserhaltung in diesem Fall nicht erf\xfcllt w\xe4re. Da ein Photon praktisch keinen Impuls aufnehmen kann, bleibt nur die M\xf6glichkeit, die Impulsdifferenz an das Kristallgitter abzugeben. Dazu muss jedoch eine als Rekombinationszentrum wirkende St\xf6rstelle (z.B. ein Fremdatom) im Gitter vorhanden sein, mit der die Ladungstr\xe4ger wechselwirken k\xf6nnen."]),t.s)
B.Kt=A.a(s(["As with direct semiconductors, thermalization occurs immediately after generation, during which the charge carriers release energy and momentum to the crystal lattice.","However, the energy minima of electrons and holes in indirect semiconductors are at different momentum values. Direct recombination of the thermalized charge carriers is therefore not possible without further ado, since momentum conservation would not be fulfilled in this case. Since a photon can absorb practically no momentum, the only possibility is to transfer the momentum difference to the crystal lattice. However, for this to happen, there must be an impurity (e.g. an impurity atom) in the lattice that acts as a recombination center and with which the charge carriers can interact."]),t.s)
B.yM=new A.c_("Indirekter Halbleiter:",B.I7,"Indirect semiconductor:",B.Kt,null)
B.EQ=new A.es(1,B.aN,B.yM,null)
